    {
      "kind": "youtube#commentThread",
      "etag": "QEywircmXKwEEXwqVTJEr845Mis",
      "id": "UgyewpRpfcJ-aoeJzNt4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "SGW3w5DD-Cb85KpcpEvbkhVCPT4",
          "id": "UgyewpRpfcJ-aoeJzNt4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Dilation of time is real, though confusing. Dilation is detected in satellite systems over gps. \u003cbr\u003e\u003cbr\u003eHowever, detected is an anomaly over current belief, that time dilates proportionately at increasing speeds. The contention now is time does not only dilate but also expand. And heres my explaination. \u003cbr\u003e\u003cbr\u003eTime distortion is essentially due to\u003cbr\u003ethe phenomenon of the doppler effect. That  such  is clearly  observed over sound, the same rationale can  be extended to light. \u003cbr\u003e\u003cbr\u003eIn the doppler phenomenon, the pitch  of the  sound source is changed to higher or lower as it passes an observer .\u003cbr\u003e\u003cbr\u003eAs like a fire engine, the sound of siren from afar progressively  gets higher in pitch as it comes . After passing through, its siren  sound gets lower in pitch as it goes . And, the firefighters  on board do not hear any difference  in siren  sound.\u003cbr\u003e\u003cbr\u003eSuch is because, sound waves within  the fire engine remain unchanged Sound waves outside of the moving fire engine will distort. Coming Sound  waves moving towards the observer compresss. Sound waves moving  away expand .\u003cbr\u003e\u003cbr\u003eWith a situation  over light, imagine a rocket with a beam of light is approaching a space station , enroute to pass it. The doppler phenomenon will distort the beam of light  towards higher frequency , then , after passing the space station , the beam will distort towards lower frequency . The astronaut in the  space station will observe a blue shift on the beam of light when its coming towards. And a red shift when its going away. The astronaut  in the rocket sees no difference.\u003cbr\u003e\u003cbr\u003eThen speed of light to all observation positions remain  unchanged, while the distances between the rocket (light source) and space station (observer) changes from far to near then to far again. Such suggest time  must have distorted  to manifest the doppler phenomenon.\u003cbr\u003e\u003cbr\u003e               c = d / t.\u003cbr\u003e\u003cbr\u003eThat c is constant, it should mean  when d is shortened, t will reduce proportionately.\u003cbr\u003e\u003cbr\u003eAnd certainly too, when d is lengthened, t will increase accordingly. \u003cbr\u003e\u003cbr\u003eThis rationale confirms the distortion of time over movements of time frames relative to each other.  However, the distortion is not only confined to dilation but should also include  expansion. \u003cbr\u003e\u003cbr\u003eAs the doppler effect exists in sound surroundings, it is suggested, time distortions  do occur at such regular circumstances. \u003cbr\u003e\u003cbr\u003eThe distortion of time is not too significant to cause much bother on earthy existence. Its significant over space and accountable when we need to compute consequences of space travel, time frames between planets, between star systems, galaxies etc.",
            "textOriginal": "Dilation of time is real, though confusing. Dilation is detected in satellite systems over gps. \n\nHowever, detected is an anomaly over current belief, that time dilates proportionately at increasing speeds. The contention now is time does not only dilate but also expand. And heres my explaination. \n\nTime distortion is essentially due to\nthe phenomenon of the doppler effect. That  such  is clearly  observed over sound, the same rationale can  be extended to light. \n\nIn the doppler phenomenon, the pitch  of the  sound source is changed to higher or lower as it passes an observer .\n\nAs like a fire engine, the sound of siren from afar progressively  gets higher in pitch as it comes . After passing through, its siren  sound gets lower in pitch as it goes . And, the firefighters  on board do not hear any difference  in siren  sound.\n\nSuch is because, sound waves within  the fire engine remain unchanged Sound waves outside of the moving fire engine will distort. Coming Sound  waves moving towards the observer compresss. Sound waves moving  away expand .\n\nWith a situation  over light, imagine a rocket with a beam of light is approaching a space station , enroute to pass it. The doppler phenomenon will distort the beam of light  towards higher frequency , then , after passing the space station , the beam will distort towards lower frequency . The astronaut in the  space station will observe a blue shift on the beam of light when its coming towards. And a red shift when its going away. The astronaut  in the rocket sees no difference.\n\nThen speed of light to all observation positions remain  unchanged, while the distances between the rocket (light source) and space station (observer) changes from far to near then to far again. Such suggest time  must have distorted  to manifest the doppler phenomenon.\n\n               c = d / t.\n\nThat c is constant, it should mean  when d is shortened, t will reduce proportionately.\n\nAnd certainly too, when d is lengthened, t will increase accordingly. \n\nThis rationale confirms the distortion of time over movements of time frames relative to each other.  However, the distortion is not only confined to dilation but should also include  expansion. \n\nAs the doppler effect exists in sound surroundings, it is suggested, time distortions  do occur at such regular circumstances. \n\nThe distortion of time is not too significant to cause much bother on earthy existence. Its significant over space and accountable when we need to compute consequences of space travel, time frames between planets, between star systems, galaxies etc.",
            "authorDisplayName": "iDOit Tinkering projects",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu9c1UrVq-uCHNEqsv9ZMKHeBmo3rDZwHTXy-A=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UCrqQFyyX_ytxoUTYTrONgSg",
