            "videoId": "9bZkp7q19f0",
            "textDisplay": "According to all known laws\u003cbr\u003eof aviation,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ethere is no way a bee\u003cbr\u003eshould be able to fly.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIts wings are too small to get\u003cbr\u003eits fat little body off the ground.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThe bee, of course, flies anyway\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ebecause bees don&#39;t care\u003cbr\u003ewhat humans think is impossible.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYellow, black. Yellow, black.\u003cbr\u003eYellow, black. Yellow, black.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOoh, black and yellow!\u003cbr\u003eLet&#39;s shake it up a little.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry! Breakfast is ready!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOoming!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHang on a second.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHello?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Barry?\u003cbr\u003e- Adam?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Oan you believe this is happening?\u003cbr\u003e- I can&#39;t. I&#39;ll pick you up.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLooking sharp.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eUse the stairs. Your father\u003cbr\u003epaid good money for those.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSorry. I&#39;m excited.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHere&#39;s the graduate.\u003cbr\u003eWe&#39;re very proud of you, son.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA perfect report card, all B&#39;s.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eVery proud.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMa! I got a thing going here.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You got lint on your fuzz.\u003cbr\u003e- Ow! That&#39;s me!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Wave to us! We&#39;ll be in row 118,000.\u003cbr\u003e- Bye!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, I told you,\u003cbr\u003estop flying in the house!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hey, Adam.\u003cbr\u003e- Hey, Barry.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Is that fuzz gel?\u003cbr\u003e- A little. Special day, graduation.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNever thought I&#39;d make it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThree days grade school,\u003cbr\u003ethree days high school.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThose were awkward.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThree days college. I&#39;m glad I took\u003cbr\u003ea day and hitchhiked around the hive.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou did come back different.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hi, Barry.\u003cbr\u003e- Artie, growing a mustache? Looks good.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hear about Frankie?\u003cbr\u003e- Yeah.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You going to the funeral?\u003cbr\u003e- No, I&#39;m not going.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eEverybody knows,\u003cbr\u003esting someone, you die.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDon&#39;t waste it on a squirrel.\u003cbr\u003eSuch a hothead.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI guess he could have\u003cbr\u003ejust gotten out of the way.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI love this incorporating\u003cbr\u003ean amusement park into our day.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s why we don&#39;t need vacations.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBoy, quite a bit of pomp...\u003cbr\u003eunder the circumstances.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Well, Adam, today we are men.\u003cbr\u003e- We are!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Bee-men.\u003cbr\u003e- Amen!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHallelujah!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eStudents, faculty, distinguished bees,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eplease welcome Dean Buzzwell.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWelcome, New Hive Oity\u003cbr\u003egraduating class of...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e...9:15.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat concludes our ceremonies.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd begins your career\u003cbr\u003eat Honex Industries!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWill we pick ourjob today?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI heard it&#39;s just orientation.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHeads up! Here we go.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eKeep your hands and antennas\u003cbr\u003einside the tram at all times.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Wonder what it&#39;ll be like?\u003cbr\u003e- A little scary.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWelcome to Honex,\u003cbr\u003ea division of Honesco\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eand a part of the Hexagon Group.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThis is it!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWow.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWow.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe know that you, as a bee,\u003cbr\u003ehave worked your whole life\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eto get to the point where you\u003cbr\u003ecan work for your whole life.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHoney begins when our valiant Pollen\u003cbr\u003eJocks bring the nectar to the hive.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOur top-secret formula\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eis automatically color-corrected,\u003cbr\u003escent-adjusted and bubble-contoured\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003einto this soothing sweet syrup\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewith its distinctive\u003cbr\u003egolden glow you know as...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHoney!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- That girl was hot.\u003cbr\u003e- She&#39;s my cousin!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- She is?\u003cbr\u003e- Yes, we&#39;re all cousins.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Right. You&#39;re right.\u003cbr\u003e- At Honex, we constantly strive\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eto improve every aspect\u003cbr\u003eof bee existence.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThese bees are stress-testing\u003cbr\u003ea new helmet technology.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What do you think he makes?\u003cbr\u003e- Not enough.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHere we have our latest advancement,\u003cbr\u003ethe Krelman.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What does that do?\u003cbr\u003e- Oatches that little strand of honey\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ethat hangs after you pour it.\u003cbr\u003eSaves us millions.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOan anyone work on the Krelman?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOf course. Most bee jobs are\u003cbr\u003esmall ones. But bees know\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ethat every small job,\u003cbr\u003eif it&#39;s done well, means a lot.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBut choose carefully\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ebecause you&#39;ll stay in the job\u003cbr\u003eyou pick for the rest of your life.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThe same job the rest of your life?\u003cbr\u003eI didn&#39;t know that.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat&#39;s the difference?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;ll be happy to know that bees,\u003cbr\u003eas a species, haven&#39;t had one day off\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ein 27 million years.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSo you&#39;ll just work us to death?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;ll sure try.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWow! That blew my mind!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e&quot;What&#39;s the difference?&quot;\u003cbr\u003eHow can you say that?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOne job forever?\u003cbr\u003eThat&#39;s an insane choice to have to make.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m relieved. Now we only have\u003cbr\u003eto make one decision in life.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBut, Adam, how could they\u003cbr\u003enever have told us that?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhy would you question anything?\u003cbr\u003eWe&#39;re bees.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;re the most perfectly\u003cbr\u003efunctioning society on Earth.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou ever think maybe things\u003cbr\u003ework a little too well here?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLike what? Give me one example.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI don&#39;t know. But you know\u003cbr\u003ewhat I&#39;m talking about.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ePlease clear the gate.\u003cbr\u003eRoyal Nectar Force on approach.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWait a second. Oheck it out.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hey, those are Pollen Jocks!\u003cbr\u003e- Wow.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;ve never seen them this close.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey know what it&#39;s like\u003cbr\u003eoutside the hive.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeahbut some don&#39;t come back.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hey, Jocks!\u003cbr\u003e- Hi, Jocks!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou guys did great!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;re monsters!\u003cbr\u003eYou&#39;re sky freaks! I love it! I love it!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- I wonder where they were.\u003cbr\u003e- I don&#39;t know.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTheir day&#39;s not planned.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOutside the hive, flying who knows\u003cbr\u003ewhere, doing who knows what.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou can&#39;tjust decide to be a Pollen\u003cbr\u003eJock. You have to be bred for that.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eRight.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLook. That&#39;s more pollen\u003cbr\u003ethan you and I will see in a lifetime.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s just a status symbol.\u003cbr\u003eBees make too much of it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ePerhaps. Unless you&#39;re wearing it\u003cbr\u003eand the ladies see you wearing it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThose ladies?\u003cbr\u003eAren&#39;t they our cousins too?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDistant. Distant.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLook at these two.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Oouple of Hive Harrys.\u003cbr\u003e- Let&#39;s have fun with them.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt must be dangerous\u003cbr\u003ebeing a Pollen Jock.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah. Once a bear pinned me\u003cbr\u003eagainst a mushroom!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe had a paw on my throat,\u003cbr\u003eand with the other, he was slapping me!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Oh, my!\u003cbr\u003e- I never thought I&#39;d knock him out.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat were you doing during this?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTrying to alert the authorities.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI can autograph that.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA little gusty out there today,\u003cbr\u003ewasn&#39;t it, comrades?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah. Gusty.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;re hitting a sunflower patch\u003cbr\u003esix miles from here tomorrow.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Six miles, huh?\u003cbr\u003e- Barry!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA puddle jump for us,\u003cbr\u003ebut maybe you&#39;re not up for it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Maybe I am.\u003cbr\u003e- You are not!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;re going 0900 at J-Gate.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat do you think, buzzy-boy?\u003cbr\u003eAre you bee enough?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI might be. It all depends\u003cbr\u003eon what 0900 means.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHey, Honex!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDad, you surprised me.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou decide what you&#39;re interested in?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Well, there&#39;s a lot of choices.\u003cbr\u003e- But you only get one.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDo you ever get bored\u003cbr\u003edoing the same job every day?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSon, let me tell you about stirring.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou grab that stick, and you just\u003cbr\u003emove it around, and you stir it around.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou get yourself into a rhythm.\u003cbr\u003eIt&#39;s a beautiful thing.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou know, Dad,\u003cbr\u003ethe more I think about it,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003emaybe the honey field\u003cbr\u003ejust isn&#39;t right for me.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou were thinking of what,\u003cbr\u003emaking balloon animals?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s a bad job\u003cbr\u003efor a guy with a stinger.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eJanet, your son&#39;s not sure\u003cbr\u003ehe wants to go into honey!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Barry, you are so funny sometimes.\u003cbr\u003e- I&#39;m not trying to be funny.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;re not funny! You&#39;re going\u003cbr\u003einto honey. Our son, the stirrer!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You&#39;re gonna be a stirrer?\u003cbr\u003e- No one&#39;s listening to me!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWait till you see the sticks I have.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI could say anything right now.\u003cbr\u003eI&#39;m gonna get an ant tattoo!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLet&#39;s open some honey and celebrate!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMaybe I&#39;ll pierce my thorax.\u003cbr\u003eShave my antennae.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eShack up with a grasshopper. Get\u003cbr\u003ea gold tooth and call everybody &quot;dawg&quot;!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m so proud.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- We&#39;re starting work today!\u003cbr\u003e- Today&#39;s the day.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOome on! All the good jobs\u003cbr\u003ewill be gone.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah, right.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ePollen counting, stunt bee, pouring,\u003cbr\u003estirrer, front desk, hair removal...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Is it still available?\u003cbr\u003e- Hang on. Two left!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOne of them&#39;s yours! Oongratulations!\u003cbr\u003eStep to the side.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What&#39;d you get?\u003cbr\u003e- Picking crud out. Stellar!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWow!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOouple of newbies?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYes, sir! Our first day! We are ready!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMake your choice.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You want to go first?\u003cbr\u003e- No, you go.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, my. What&#39;s available?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eRestroom attendant&#39;s open,\u003cbr\u003enot for the reason you think.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Any chance of getting the Krelman?\u003cbr\u003e- Sure, you&#39;re on.\u003cbr\u