osting.\u003cbr\u003eThey heat it up...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSit down!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e...really hot!\u003cbr\u003e- Listen to me!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe are not them! We&#39;re us.\u003cbr\u003eThere&#39;s us and there&#39;s them!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYesbut who can deny\u003cbr\u003ethe heart that is yearning?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThere&#39;s no yearning.\u003cbr\u003eStop yearning. Listen to me!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou have got to start thinking bee,\u003cbr\u003emy friend. Thinking bee!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Thinking bee.\u003cbr\u003e- Thinking bee.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThinking bee! Thinking bee!\u003cbr\u003eThinking bee! Thinking bee!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThere he is. He&#39;s in the pool.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou know what your problem is, Barry?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI gotta start thinking bee?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow much longer will this go on?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s been three days!\u003cbr\u003eWhy aren&#39;t you working?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;ve got a lot of big life decisions\u003cbr\u003eto think about.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat life? You have no life!\u003cbr\u003eYou have no job. You&#39;re barely a bee!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWould it kill you\u003cbr\u003eto make a little honey?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, come out.\u003cbr\u003eYour father&#39;s talking to you.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMartin, would you talk to him?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, I&#39;m talking to you!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou coming?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eGot everything?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003