9;t have that?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe have Hivobut it&#39;s a disease.\u003cbr\u003eIt&#39;s a horrible, horrible disease.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, my.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDumb bees!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou must want to sting all those jerks.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe try not to sting.\u003cbr\u003eIt&#39;s usually fatal for us.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSo you have to watch your temper.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eVery carefully.\u003cbr\u003eYou kick a wall, take a walk,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewrite an angry letter and throw it out.\u003cbr\u003eWork through it like any emotion:\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnger, jealousy, lust.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, my goodness! Are you OK?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What is wrong with you?!\u003cbr\u003e- It&#39;s a bug.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe&#39;s not bothering anybody.\u003cbr\u003eGet out of here, you creep!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat was that? A Pic &#39;N&#39; Save circular?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah, it was. How did you know?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt felt like about 10 pages.\u003cbr\u003eSeventy-five is pretty much our limit.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;ve really got that\u003cbr\u003edown to a science.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- I lost a cousin to Italian Vogue.\u003cbr\u003e- I&#39;ll bet.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat in the name\u003cbr\u003eof Mighty Hercules is this?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow did this get here?\u003cbr\u003eOute Bee, Golden Blossom,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eRay Liotta Private Select?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Is he that actor?\u003cbr\u003e- I never heard of him.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Why is this here?\u003cbr\u003e- For people. We eat it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou don&#39;t have\u003cbr\u003eenough food of your own?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Well, yes.\u003cbr\u003e- How do you get it?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Bees make it.\u003cbr\u003e- I know who makes it!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd it&#39;s hard to make it!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThere&#39;s heating, cooling, stirring.\u003cbr\u003eYou need a whole Krelman thing!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- It&#39;s organic.\u003cbr\u003e- It&#39;s our-ganic!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s just honey, Barry.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eJust what?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBees don&#39;t know about this!\u003cbr\u003eThis is stealing! A lot of stealing!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;ve taken our homes, schools,\u003cbr\u003ehospitals! This is all we have!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd it&#39;s on sale?!\u003cbr\u003eI&#39;m getting to the bottom of this.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m getting to the bottom\u003cbr\u003eof all of this!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHey, Hector.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You almost done?\u003cbr\u003e- Almost.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe is here. I sense it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWell, I guess I&#39;ll go home now\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eand just leave this nice honey out,\u003cbr\u003ewith no one around.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;re busted, box boy!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI knew I heard something.\u003cbr\u003eSo you can talk!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI can talk.\u003cbr\u003eAnd now you&#39;ll start talking!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhere you getting the sweet stuff?\u003cbr\u003eWho&#39;s your supplier?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI don&#39;t understand.\u003cbr\u003eI thought we were friends.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThe last thing we want\u003cbr\u003eto do is upset bees!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;re too late! It&#39;s ours now!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou, sir, have crossed\u003cbr\u003ethe wrong sword!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou, sir, will be lunch\u003cbr\u003efor my iguana, Ignacio!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhere is the honey coming from?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTell me where!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHoney Farms! It comes from Honey Farms!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOrazy person!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat horrible thing has happened here?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThese faces, they never knew\u003cbr\u003ewhat hit them. And now\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ethey&#39;re on the road to nowhere!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eJust keep still.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat? You&#39;re not dead?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDo I look dead? They will wipe anything\u003cbr\u003ethat moves. Where you headed?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTo Honey Farms.\u003cbr\u003eI am onto something huge here.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m going to Alaska. Moose blood,\u003cbr\u003ecrazy stuff. Blows your head off!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m going to Tacoma.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- And you?\u003cbr\u003e- He really is dead.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAll right.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eUh-oh!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What is that?!\u003cbr\u003e- Oh, no!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- A wiper! Triple blade!\u003cbr\u003e- Triple blade?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eJump on! It&#39;s your only chance, bee!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhy does everything have\u003cbr\u003eto be so doggone clean?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow much do you people need to see?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOpen your eyes!\u003cbr\u003eStick your head out the window!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eFrom NPR News in Washington,\u003cbr\u003eI&#39;m Oarl Kasell.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBut don&#39;t kill no more bugs!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Bee!\u003cbr\u003e- Moose blood guy!!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You hear something?\u003cbr\u003e- Like what?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLike tiny screaming.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTurn off the radio.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhassup, bee boy?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHey, Blood.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eJust a row of honey jars,\u003cbr\u003eas far as the eye could see.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWow!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI assume wherever this truck goes\u003cbr\u003eis where they&#39;re getting it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI mean, that honey&#39;s ours.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Bees hang tight.\u003cbr\u003e- We&#39;re all jammed in.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s a close community.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNot us, man. We on our own.\u003cbr\u003eEvery mosquito on his own.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What if you get in trouble?\u003cbr\u003e- You a mosquito, you in trouble.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNobody likes us. They just smack.\u003cbr\u003eSee a mosquito, smack, smack!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAt least you&#39;re out in the world.\u003cbr\u003eYou must meet girls.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMosquito girls try to trade up,\u003cbr\u003eget with a moth, dragonfly.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMosquito girl don&#39;t want no mosquito.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou got to be kidding me!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMooseblood&#39;s about to leave\u003cbr\u003ethe building! So long, bee!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hey, guys!\u003cbr\u003e- Mooseblood!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI knew I&#39;d catch y&#39;all down here.\u003cbr\u003eDid you bring your crazy straw?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe throw it in jars, slap a label on it,\u003cbr\u003eand it&#39;s pretty much pure profit.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat is this place?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA bee&#39;s got a brain\u003cbr\u003ethe size of a pinhead.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey are pinheads!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ePinhead.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Oheck out the new smoker.\u003cbr\u003e- Oh, sweet. That&#39;s the one you want.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThe Thomas 3000!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSmoker?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNinety puffs a minute, semi-automatic.\u003cbr\u003eTwice the nicotine, all the tar.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA couple breaths of this\u003cbr\u003eknocks them right out.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey make the honey,\u003cbr\u003eand we make the money.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e&quot;They make the honey,\u003cbr\u003eand we make the money&quot;?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, my!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat&#39;s going on? Are you OK?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah. It doesn&#39;t last too long.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDo you know you&#39;re\u003cbr\u003ein a fake hive with fake walls?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOur queen was moved here.\u003cbr\u003eWe had no choice.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThis is your queen?\u003cbr\u003eThat&#39;s a man in women&#39;s clothes!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s a drag queen!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat is this?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, no!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThere&#39;s hundreds of them!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBee honey.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOur honey is being brazenly stolen\u003cbr\u003eon a massive scale!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThis is worse than anything bears\u003cbr\u003ehave done! I intend to do something.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, Barry, stop.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWho told you humans are taking\u003cbr\u003eour honey? That&#39;s a rumor.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDo these look like rumors?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s a conspiracy theory.\u003cbr\u003eThese are obviously doctored photos.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow did you get mixed up in this?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe&#39;s been talking to humans.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What?\u003cbr\u003e- Talking to humans?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe has a human girlfriend.\u003cbr\u003eAnd they make out!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMake out? Barry!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe do not.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- You wish you could.\u003cbr\u003e- Whose side are you on?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThe bees!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI dated a cricket once in San Antonio.\u003cbr\u003eThose crazy legs kept me up all night.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, this is what you want\u003cbr\u003eto do with your life?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI want to do it for all our lives.\u003cbr\u003eNobody works harder than bees!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDad, I remember you\u003cbr\u003ecoming home so overworked\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eyour hands were still stirring.\u003cbr\u003eYou couldn&#39;t stop.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI remember that.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat right do they have to our honey?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe live on two cups a year. They put it\u003cbr\u003ein lip balm for no reason whatsoever!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eEven if it&#39;s true, what can one bee do?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSting them where it really hurts.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIn the face! The eye!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- That would hurt.\u003cbr\u003e- No.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eUp the nose? That&#39;s a killer.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThere&#39;s only one place you can sting\u003cbr\u003ethe humans, one place where it matters.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHive at Five, the hive&#39;s only\u003cbr\u003efull-hour action news source.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNo more bee beards!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWith Bob Bumble at the anchor desk.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWeather with Storm Stinger.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSports with Buzz Larvi.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd Jeanette Ohung.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Good evening. I&#39;m Bob Bumble.\u003cbr\u003e- And I&#39;m Jeanette Ohung.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA tri-county bee, Barry Benson,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eintends to sue the human race\u003cbr\u003efor stealing our honey,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003epackaging it and profiting\u003cbr\u003efrom it illegally!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTomorrow night on Bee Larry King,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewe&#39;ll have three former queens here in\u003cbr\u003eour studio, discussing their new book,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOlassy Ladies,\u003cbr\u003eout this week on Hexagon.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTonight we&#39;re talking to Barry Benson.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDid you ever think, &quot;I&#39;m a kid\u003cbr\u003efrom the hive. I can&#39;t do this&quot;?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBees have never been afraid\u003cbr\u003eto change the world.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat about Bee Oolumbus?\u003cbr\u003eBee Gandhi? Bejesus?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhere I&#39;m from, we&#39;d never sue humans.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe were thinking\u003cbr\u003eof stickball or candy stores.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow old are you?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThe bee community\u003cbr\u003eis supporting you in this case,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewhich will be the trial\u003cbr\u003eof the bee century.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou know, they have a Larry King\u003cbr\u003ein the human world too.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s a common name. Next week...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe looks like you and has a show\u003cbr\u003eand suspenders and colored dots...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNext week...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eGlasses, quotes on the bottom from the\u003cbr\u003eguest even though you just heard &#39;em.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBear Week next week!\u003cbr\u003eThey&#39;re scary, hairy and here live.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAlways leans forward, pointy shoulders,\u003cbr\u003esquinty eyes, very Jewish.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIn tennis, you attack\u003cbr\u003eat the point of weakness!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt was my grandmother, Ken. She&#39;s 81.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHoney, her backhand&#39;s a joke!\u003cbr\u003eI&#39;m not gonna take advantage of that?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eQuiet, please.\u003cbr\u003eActual work going on here.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Is that that same bee?\u003cbr\u003e- Yes, it is!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m helping him sue the human race.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Hello.\u003cbr\u003e- Hello, bee.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThis is Ken.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYeah, I remember you. Timberland, size\u003cbr\u003eten and a half. Vibram sole, I believe.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhy does he talk again?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eListen, you better go\u003cbr\u003e&#39;cause we&#39;re really busy working.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBut it&#39;s our yogurt night!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBye-bye.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhy is yogurt night so difficult?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou poor thing.\u003cbr\u003eYou two have been at this for hours!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYes, and Adam here\u003cbr\u003ehas been a huge help.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Frosting...\u003cbr\u003e- How many sugars?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eJust one. I try not\u003cbr\u003eto use the competition.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSo why are you helping me?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBees have good qualities.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd it takes my mind off the shop.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eInstead of flowers, people\u003cbr\u003eare giving balloon bouquets now.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThose are great, if you&#39;re three.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd artificial flowers.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Oh, those just get me psychotic!\u003cbr\u003e- Yeah, me too.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBent stingers, pointless pollination.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBees must hate those fake things!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNothing worse\u003cbr\u003ethan a daffodil that&#39;s had work done.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMaybe this could make up\u003cbr\u003efor it a little bit.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- This lawsuit&#39;s a pretty big deal.\u003cbr\u003e- I guess.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou sure you want to go through with it?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAm I sure? When I&#39;m done with\u003cbr\u003ethe humans, they won&#39;t be able\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eto say, &quot;Honey, I&#39;m home,&quot;\u003cbr\u003ewithout paying a royalty!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s an incredible scene\u003cbr\u003ehere in downtown Manhattan,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewhere the world anxiously waits,\u003cbr\u003ebecause for the first time in history,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewe will hear for ourselves\u003cbr\u003eif a honeybee can actually speak.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat have we gotten into here, Barry?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s pretty big, isn&#39;t it?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI can&#39;t believe how many humans\u003cbr\u003edon&#39;t work during the day.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou think billion-dollar multinational\u003cbr\u003efood companies have good lawyers?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eEverybody needs to stay\u003cbr\u003ebehind the barricade.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What&#39;s the matter?\u003cbr\u003e- I don&#39;t know, I just got a chill.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWell, if it isn&#39;t the bee team.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou boys work on this?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAll rise! The Honorable\u003cbr\u003eJudge Bumbleton presiding.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAll right. Oase number 4475,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSuperior Oourt of New York,\u003cbr\u003eBarry Bee Benson v. the Honey Industry\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eis now in session.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMr. Montgomery, you&#39;re representing\u003cbr\u003ethe five food companies collectively?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eA privilege.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMr. Benson... you&#39;re representing\u003cbr\u003eall the bees of the world?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m kidding. Yes, Your Honor,\u003cbr\u003ewe&#39;re ready to proceed.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMr. Montgomery,\u003cbr\u003eyour opening statement, please.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLadies and gentlemen of the jury,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003emy grandmother was a simple woman.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBorn on a farm, she believed\u003cbr\u003eit was man&#39;s divine right\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eto benefit from the bounty\u003cbr\u003eof nature God put before us.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIf we lived in the topsy-turvy world\u003cbr\u003eMr. Benson imagines,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ejust think of what would it mean.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI would have to negotiate\u003cbr\u003ewith the silkworm\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003efor the elastic in my britches!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTalking bee!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow do we know this isn&#39;t some sort of\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eholographic motion-picture-capture\u003cbr\u003eHollywood wizardry?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey could be using laser beams!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eRobotics! Ventriloquism!\u003cbr\u003eOloning! For all we know,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ehe could be on steroids!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMr. Benson?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLadies and gentlemen,\u003cbr\u003ethere&#39;s no trickery here.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m just an ordinary bee.\u003cbr\u003eHoney&#39;s pretty important to me.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s important to all bees.\u003cbr\u003eWe invented it!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe make it. And we protect it\u003cbr\u003ewith our lives.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eUnfortunately, there are\u003cbr\u003esome people in this room\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewho think they can take it from us\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e&#39;cause we&#39;re the little guys!\u003cbr\u003eI&#39;m hoping that, after this is all over,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eyou&#39;ll see how, by taking our honey,\u003cbr\u003eyou not only take everything we have\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ebut everything we are!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI wish he&#39;d dress like that\u003cbr\u003eall the time. So nice!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOall your first witness.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSo, Mr. Klauss Vanderhayden\u003cbr\u003eof Honey Farms, big company you have.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI suppose so.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI see you also own\u003cbr\u003eHoneyburton and Honron!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYes, they provide beekeepers\u003cbr\u003efor our farms.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBeekeeper. I find that\u003cbr\u003eto be a very disturbing term.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI don&#39;t imagine you employ\u003cbr\u003eany bee-free-ers, do you?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- No.\u003cbr\u003e- I couldn&#39;t hear you.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- No.\u003cbr\u003e- No.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBecause you don&#39;t free bees.\u003cbr\u003eYou keep bees. Not only that,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eit seems you thought a bear would be\u003cbr\u003ean appropriate image for a jar of honey.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey&#39;re very lovable creatures.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYogi Bear, Fozzie Bear, Build-A-Bear.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou mean like this?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBears kill bees!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHow&#39;d you like his head crashing\u003cbr\u003ethrough your living room?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBiting into your couch!\u003cbr\u003eSpitting out your throw pillows!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOK, that&#39;s enough. Take him away.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSo, Mr. Sting, thank you for being here.\u003cbr\u003eYour name intrigues me.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Where have I heard it before?\u003cbr\u003e- I was with a band called The Police.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBut you&#39;ve never been\u003cbr\u003ea police officer, have you?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNo, I haven&#39;t.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNo, you haven&#39;t. And so here\u003cbr\u003ewe have yet another example\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eof bee culture casually\u003cbr\u003estolen by a human\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003efor nothing more than\u003cbr\u003ea prance-about stage name.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, please.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHave you ever been stung, Mr. Sting?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBecause I&#39;m feeling\u003cbr\u003ea little stung, Sting.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOr should I say... Mr. Gordon M. Sumner!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s not his real name?! You idiots!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMr. Liotta, first,\u003cbr\u003ebelated congratulations on\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eyour Emmy win for a guest spot\u003cbr\u003eon ER in 2005.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThank you. Thank you.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI see from your resume\u003cbr\u003ethat you&#39;re devilishly handsome\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ewith a churning inner turmoil\u003cbr\u003ethat&#39;s ready to blow.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI enjoy what I do. Is that a crime?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNot yet it isn&#39;t. But is this\u003cbr\u003ewhat it&#39;s come to for you?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eExploiting tiny, helpless bees\u003cbr\u003eso you don&#39;t\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ehave to rehearse\u003cbr\u003eyour part and learn your lines, sir?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWatch it, Benson!\u003cbr\u003eI could blow right now!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThis isn&#39;t a goodfella.\u003cbr\u003eThis is a badfella!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhy doesn&#39;t someone just step on\u003cbr\u003ethis creep, and we can all go home?!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Order in this court!\u003cbr\u003e- You&#39;re all thinking it!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOrder! Order, I say!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Say it!\u003cbr\u003e- Mr. Liotta, please sit down!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI think it was awfully nice\u003cbr\u003eof that bear to pitch in like that.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI think the jury&#39;s on our side.\u003cbr\u003e\u003cbr\u00