 of nature, Benson.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;ll regret this.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, how much honey is out there?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAll right. One at a time.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, who are you wearing?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMy sweater is Ralph Lauren,\u003cbr\u003eand I have no pants.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What if Montgomery&#39;s right?\u003cbr\u003e- What do you mean?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;ve been living the bee way\u003cbr\u003ea long time, 27 million years.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOongratulations on your victory.\u003cbr\u003eWhat will you demand as a settlement?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eFirst, we&#39;ll demand a complete shutdown\u003cbr\u003eof all bee work camps.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThen we want back the honey\u003cbr\u003ethat was ours to begin with,\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eevery last drop.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe demand an end to the glorification\u003cbr\u003eof the bear as anything more\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003ethan a filthy, smelly,\u003cbr\u003ebad-breath stink machine.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;re all aware\u003cbr\u003eof what they do in the woods.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWait for my signal.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTake him out.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe&#39;ll have nauseous\u003cbr\u003efor a few hours, then he&#39;ll be fine.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd we will no longer tolerate\u003cbr\u003ebee-negative nicknames...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBut it&#39;s just a prance-about stage name!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e...unnecessary inclusion of honey\u003cbr\u003ein bogus health products\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eand la-dee-da human\u003cbr\u003etea-time snack garnishments.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOan&#39;t breathe.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBring it in, boys!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHold it right there! Good.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTap it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMr. Buzzwell, we just passed three cups,\u003cbr\u003eand there&#39;s gallons more coming!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- I think we need to shut down!\u003cbr\u003e- Shut down? We&#39;ve never shut down.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eShut down honey production!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eStop making honey!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTurn your key, sir!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat do we do now?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOannonball!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWe&#39;re shutting honey production!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMission abort.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAborting pollination and nectar detail.\u003cbr\u003eReturning to base.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAdam, you wouldn&#39;t believe\u003cbr\u003ehow much honey was out there.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, yeah?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat&#39;s going on? Where is everybody?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Are they out celebrating?\u003cbr\u003e- They&#39;re home.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey don&#39;t know what to do.\u003cbr\u003eLaying out, sleeping in.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI heard your Uncle Oarl was on his way\u003cbr\u003eto San Antonio with a cricket.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAt least we got our honey back.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSometimes I think, so what if humans\u003cbr\u003eliked our honey? Who wouldn&#39;t?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s the greatest thing in the world!\u003cbr\u003eI was excited to be part of making it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThis was my new desk. This was my\u003cbr\u003enew job. I wanted to do it really well.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd now...\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNow I can&#39;t.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI don&#39;t understand\u003cbr\u003ewhy they&#39;re not happy.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI thought their lives would be better!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey&#39;re doing nothing. It&#39;s amazing.\u003cbr\u003eHoney really changes people.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou don&#39;t have any idea\u003cbr\u003ewhat&#39;s going on, do you?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- What did you want to show me?\u003cbr\u003e- This.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWhat happened here?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat is not the half of it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eOh, no. Oh, my.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThey&#39;re all wilting.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eDoesn&#39;t look very good, does it?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNo.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAnd whose fault do you think that is?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou know, I&#39;m gonna guess bees.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBees?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSpecifically, me.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI didn&#39;t think bees not needing to make\u003cbr\u003ehoney would affect all these things.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIt&#39;s notjust flowers.\u003cbr\u003eFruits, vegetables, they all need bees.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s our whole SAT test right there.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eTake away produce, that affects\u003cbr\u003ethe entire animal kingdom.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u0