e  \u003cbr\u003eOh, yeah.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat&#39;s our Barry.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMom! The bees are back!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eIf anybody needs\u003cbr\u003eto make a call, now&#39;s the time.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI got a feeling we&#39;ll be\u003cbr\u003eworking late tonight!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHere&#39;s your change. Have a great\u003cbr\u003eafternoon! Oan I help who&#39;s next?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWould you like some honey with that?\u003cbr\u003eIt is bee-approved. Don&#39;t forget these.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eMilk, cream, cheese, it&#39;s all me.\u003cbr\u003eAnd I don&#39;t see a nickel!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSometimes I just feel\u003cbr\u003elike a piece of meat!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI had no idea.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, I&#39;m sorry.\u003cbr\u003eHave you got a moment?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eWould you excuse me?\u003cbr\u003eMy mosquito associate will help you.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eSorry I&#39;m late.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHe&#39;s a lawyer too?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI was already a blood-sucking parasite.\u003cbr\u003eAll I needed was a briefcase.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHave a great afternoon!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBarry, I just got this huge tulip order,\u003cbr\u003eand I can&#39;t get them anywhere.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eNo problem, Vannie.\u003cbr\u003eJust leave it to me.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou&#39;re a lifesaver, Barry.\u003cbr\u003eOan I help who&#39;s next?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAll right, scramble, jocks!\u003cbr\u003eIt&#39;s time to fly.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThank you, Barry!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eThat bee is living my life!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eLet it go, Kenny.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- When will this nightmare end?!\u003cbr\u003e- Let it all go.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Beautiful day to fly.\u003cbr\u003e- Sure is.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eBetween you and me,\u003cbr\u003eI was dying to get out of that office.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eYou have got\u003cbr\u003eto start thinking bee, my friend.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003e- Thinking bee!\u003cbr\u003e- Me?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eHold it. Let&#39;s just stop\u003cbr\u003efor a second. Hold it.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m sorry. I&#39;m sorry, everyone.\u003cbr\u003eOan we stop here?\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI&#39;m not making a major life decision\u003cbr\u003eduring a production number!\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eAll right. Take ten, everybody.\u003cbr\u003eWrap it up, guys.\u003cbr\u003e\u003cbr\u003e  \u003cbr\u003eI had virtually no rehearsal for that.",
            "textOriginal": "According to all known laws\nof aviation,\n\n  \nthere is no way a bee\nshould be able to fly.\n\n  \nIts wings are too small to get\nits fat little body off the ground.\n\n  \nThe bee, of course, flies anyway\n\n  \nbecause bees don't care\nwhat humans think is impossible.\n\n  \nYellow, black. Yellow, black.\nYellow, black. Yellow, black.\n\n  \nOoh, black and yellow!\nLet's shake it up a little.\n\n  \nBarry! Breakfast is ready!\n\n  \nOoming!\n\n  \nHang on a second.\n\n  \nHello?\n\n  \n- Barry?\n- Adam?\n\n  \n- Oan you believe this is happening?\n- I can't. I'll pick you up.\n\n  \nLooking sharp.\n\n  \nUse the stairs. Your father\npaid good money for those.\n\n  \nSorry. I'm excited.\n\n  \nHere's the graduate.\nWe're very proud of you, son.\n\n  \nA perfect report card, all B's.\n\n  \nVery proud.\n\n  \nMa! I got a thing going here.\n\n  \n- You got lint on your fuzz.\n- Ow! That's me!\n\n  \n- Wave to us! We'll be in row 118,000.\n- Bye!\n\n  \nBarry, I told you,\nstop flying in the house!\n\n  \n- Hey, Adam.\n- Hey, Barry.\n\n  \n- Is that fuzz gel?\n- A little. Special day, graduation.\n\n  \nNever thought I'd make it.\n\n  \nThree days grade school,\nthree days high school.\n\n  \nThose were awkward.\n\n  \nThree days college. I'm glad I took\na day and hitchhiked around the hive.\n\n  \nYou did come back different.\n\n  \n- Hi, Barry.\n- Artie, growing a mustache? Looks good.\n\n  \n- Hear about Frankie?\n- Yeah.\n\n  \n- You going to the funeral?\n- No, I'm not going.\n\n  \nEverybody knows,\nsting someone, you die.\n\n  \nDon't waste it on a squirrel.\nSuch a hothead.\n\n  \nI guess he could have\njust gotten out of the way.\n\n  \nI love this incorporating\nan amusement park into our day.\n\n  \nThat's why we don't need vacations.\n\n  \nBoy, quite a bit of pomp...\nunder the circumstances.\n\n  \n- Well, Adam, today we are men.\n- We are!\n\n  \n- Bee-men.\n- Amen!\n\n  \nHallelujah!\n\n  \nStudents, faculty, distinguished bees,\n\n  \nplease welcome Dean Buzzwell.\n\n  \nWelcome, New Hive Oity\ngraduating class of...\n\n  \n...9:15.\n\n  \nThat concludes our ceremonies.\n\n  \nAnd begins your career\nat Honex Industries!\n\n  \nWill we pick ourjob today?\n\n  \nI heard it's just orientation.\n\n  \nHeads up! Here we go.\n\n  \nKeep your hands and antennas\ninside the tram at all times.\n\n  \n- Wonder what it'll be like?\n- A little scary.\n\n  \nWelcome to Honex,\na division of Honesco\n\n  \nand a part of the Hexagon Group.\n\n  \nThis is it!\n\n  \nWow.\n\n  \nWow.\n\n  \nWe know that you, as a bee,\nhave worked your whole life\n\n  \nto get to the point where you\ncan work for your whole life.\n\n  \nHoney begins when our valiant Pollen\nJocks bring the nectar to the hive.\n\n  \nOur top-secret formula\n\n  \nis automatically color-corrected,\nscent-adjusted and bubble-contoured\n\n  \ninto this soothing sweet syrup\n\n  \nwith its distinctive\ngolden glow you know as...\n\n  \nHoney!\n\n  \n- That girl was hot.\n- She's my cousin!\n\n  \n- She is?\n- Yes, we're all cousins.\n\n  \n- Right. You're right.\n- At Honex, we constantly strive\n\n  \nto improve every aspect\nof bee existence.\n\n  \nThese bees are stress-testing\na new helmet technology.\n\n  \n- What do you think he makes?\n- Not enough.\n\n  \nHere we have our latest advancement,\nthe Krelman.\n\n  \n- What does that do?\n- Oatches that little strand of honey\n\n  \nthat hangs after you pour it.\nSaves us millions.\n\n  \nOan anyone work on the Krelman?\n\n  \nOf course. Most bee jobs are\nsmall ones. But bees know\n\n  \nthat every small job,\nif it's done well, means a lot.\n\n  \nBut choose carefully\n\n  \nbecause you'll stay in the job\nyou pick for the rest of your life.\n\n  \nThe same job the rest of your life?\nI didn't know that.\n\n  \nWhat's the difference?\n\n  \nYou'll be happy to know that bees,\nas a species, haven't had one day off\n\n  \nin 27 million years.\n\n  \nSo you'll just work us to death?\n\n  \nWe'll sure try.\n\n  \nWow! That blew my mind!\n\n  \n\"What's the difference?\"\nHow can you say that?\n\n  \nOne job forever?\nThat's an insane choice to have to make.\n\n  \nI'm relieved. Now we only have\nto make one decision in life.\n\n  \nBut, Adam, how could they\nnever have told us that?\n\n  \nWhy would you question anything?\nWe're bees.\n\n  \nWe're the most perfectly\nfunctioning society on Earth.\n\n  \nYou ever think maybe things\nwork a little too well here?\n\n  \nLike what? Give me one example.\n\n  \nI don't know. But you know\nwhat I'm talking about.\n\n  \nPlease clear the gate.\nRoyal Nectar Force on approach.\n\n  \nWait a second. Oheck it out.\n\n  \n- Hey, those are Pollen Jocks!\n- Wow.\n\n  \nI've never seen them this close.\n\n  \nThey know what it's like\noutside the hive.\n\n  \nYeahbut some don't come back.\n\n  \n- Hey, Jocks!\n- Hi, Jocks!\n\n  \nYou guys did great!\n\n  \nYou're monsters!\nYou're sky freaks! I love it! I love it!\n\n  \n- I wonder where they were.\n- I don't know.\n\n  \nTheir day's not planned.\n\n  \nOutside the hive, flying who knows\nwhere, doing who knows what.\n\n  \nYou can'tjust decide to be a Pollen\nJock. You have to be bred for that.\n\n  \nRight.\n\n  \nLook. That's more pollen\nthan you and I will see in a lifetime.\n\n  \nIt's just a status symbol.\nBees make too much of it.\n\n  \nPerhaps. Unless you're wearing it\nand the ladies see you wearing it.\n\n  \nThose ladies?\nAren't they our cousins too?\n\n  \nDistant. Distant.\n\n  \nLook at these two.\n\n  \n- Oouple of Hive Harrys.\n- Let's have fun with them.\n\n  \nIt must be dangerous\nbeing a Pollen Jock.\n\n  \nYeah. Once a bear pinned me\nagainst a mushroom!\n\n  \nHe had a paw on my throat,\nand with the other, he was slapping me!\n\n  \n- Oh, my!\n- I never thought I'd knock him out.\n\n  \nWhat were you doing during this?\n\n  \nTrying to alert the authorities.\n\n  \nI can autograph that.\n\n  \nA little gusty out there today,\nwas