            "textDisplay": "Good morning dear brothers and sisters, my beloved children, from all over the world.\u003cbr\u003e\u003cbr\u003eMy name is Sorin and I announce you that today,  First of September 2015 I was invested by the Authority of Our Father, Creator of the Universe, to be the Spiritual Leader of the Humanity from now on.\u003cbr\u003eYou have prayed for this for centuries and now, in this very moment of great despair, your Father, in His infinite love for you, send  me to lead you in your next stage of evolution.\u003cbr\u003e I am a normal person as you are, the only difference between us is the job that we must accomplish. You must do yours and I&#39;ll do mine. We are a team, the biggest team ever and as a team we will been able to solve the toughest challenges that we might encounter. \u003cbr\u003eI&#39;m not a religious man, I never was. It&#39;s not in my intention to interfere in the religious affairs.  I&#39;m an engineer, not a priest and our Father send  me to you because now you need a practical help, not a teological one. I&#39;m not Jesus, Mohamed, Budha or anyone else you know, because these Wise Teachers  was already sent to you when you&#39;re in infancy, to teach all the things that you need to know as a child race.\u003cbr\u003eBut in fact it was one thing only they want you to know: To love each other.\u003cbr\u003e I am Sorin - The Unifier, who do his job in a team with a more evolved  human race, a more educated peoples, that will be united as a single family, the great family of Planet Earth.\u003cbr\u003eI am not a healer for human body, because for that there are doctorsbut for human soul. You call me and I am here my beloved children.\u003cbr\u003eMy job is to bring joy in your souls and balance in your lives.\u003cbr\u003e\u003cbr\u003eNow, my first task as your Spiritual Leader, is to officially announces you that on the 23th of September 2015 at 11.11 GMT will be the Graduation Day, or in short the G-Day. I call it the Graduation Day, because on that specific day we will celebrate the end of your childhood as a human race and the beginning of your adulthood period.  On that day, at that specific hour, I&#39;ll give to all of you, brothers and sisters, the invitation to heal your souls, because on that date, at that specific hour, all the people on Planet Earth will drop the weapons and will embrace each other with great love and compassion, be it his dearest friend, a complete stranger or his most fierce enemy. \u003cbr\u003eAnd in an instant, your souls will be brought to life, because today, my beloved children, your souls are dying slowly. Only one tiny grain of Faith you&#39;ve preserved,  spared  you from a catastrophe at planetary level and allowed me to arrive here, just in time to avoid that. You must endure for the damage you&#39;ve  done till nowbut my role is to alleviate your sorrow and to inspire you to make a better Earth for you and for the future generations.\u003cbr\u003eUntil now, on your own, you built Hell on Earth because you are infantile and misguided. Now you know what the Hell is. \u003cbr\u003eFrom now on, you&#39;ll start to build the Heaven on Earth because you reach the maturity, and you will know what the Heaven is.\u003cbr\u003eIt&#39;s not an overnight task or an easy onebut no matter how difficult might be, your heart will sing in joy and your soul will celebrate, because you build the Heaven directly on Earth when you are alive and not in the skies when you&#39;re dead. \u003cbr\u003eDear fighters on all wars existing now on Earth, I know you&#39;re brave men, whichever side you&#39;ve taken, and I&#39;ll explain later to all the world how important was your role in the evolution of humanity,  but now I announce you that your task is accomplished and you don&#39;t need the weapons anymore. You must know, that I love you all and I don’t care what you did beforebut what you do from now on. \u003cbr\u003eWhat you did until now was part of your learning process as a child human race. \u003cbr\u003eI ask now the governments you fought against, to pardon you, and to your victim to forgive you because being in Hell for that long you&#39;ve already been punished. \u003cbr\u003eIt’s not a time to revenge but a time of compassion and joy. \u003cbr\u003eYou are suffering too much and for so long.\u003cbr\u003eEnough is enough. \u003cbr\u003e I am not here to bring chaosbut order, not punishment but love. I am not here to overthrown governmentsbut to cooperate with them. Not to divide but to unite the human race, in order to face together all provocations that are to come. Because, as in everyday life, an adult have much more responsibilities and  much more difficult tasks to accomplish than a child. So works the Universe.\u003cbr\u003e\u003cbr\u003eYou must know that very soon, I&#39;ll take my office, so that you could see me in person, and after that, in a reasonable timeframe, I&#39;ll present to you, my beloved children, the main rules that are to be respected here on Planet Earth from now on. All of you are welcome to see me, or to talk with me. The doors of my office and the doors of my heart will be permanently open for you. \u003cbr\u003eYou will permanently find me on my office. \u003cbr\u003eI’ll never leave it and I never leave you. \u003cbr\u003eTo not rush to see me in person, because that will provoke chaos; the infrastructure is not prepared for that event of a planetary scale. I ask you to not act childish, you’re grown up now. But you may see me as you wish on your TV sets or internet. Will be 24/24 hours transmissions. Worldwide media will be here. \u003cbr\u003eBut now I have an emergency to focus on. Some of my children are in desperate situation and I must concentrate myself on that matter now. Remember, I am a human being as you are.  \u003cbr\u003eWhen the things will cools down, the touristic tours for peoples of all countries will be programmed, in order to be a beautiful experience not an exhausting one.  \u003cbr\u003e Now hurry up to bring that wonderful news to all peoples on Earth. They desperately wait for it. Translate it, share itbut do it quickly because any minute of delay means a life wasted meaningless somewhere in this beautiful world. \u003cbr\u003e\u003cbr\u003eLove and Peace my beloved children\u003cbr\u003eSorin – The Unifier",
            "textOriginal": "Good morning dear brothers and sisters, my beloved children, from all over the world.\n\nMy name is Sorin and I announce you that today,  First of September 2015 I was invested by the Authority of Our Father, Creator of the Universe, to be the Spiritual Leader of the Humanity from now on.\nYou have prayed for this for centuries and now, in this very moment of great despair, your Father, in His infinite love for you, send  me to lead you in your next stage of evolution.\n I am a normal person as you are, the only difference between us is the job that we must accomplish. You must do yours and I'll do mine. We are a team, the biggest team ever and as a team we will been able to solve the toughest challenges that we might encounter. \nI'm not a religious man, I never was. It's not in my intention to interfere in the religious affairs.  I'm an engineer, not a priest and our Father send  me to you because now you need a practical help, not a teological one. I'm not Jesus, Mohamed, Budha or anyone else you know, because these Wise Teachers  was already sent to you when you're in infancy, to teach all the things that you need to know as a child race.\nBut in fact it was one thing only they want you to know: To love each other.\n I am Sorin - The Unifier, who do his job in a team with a more evolved  human race, a more educated peoples, that will be united as a single family, the great family of Planet Earth.\nI am not a healer for human body, because for that there are doctorsbut for human soul. You call me and I am here my beloved children.\nMy job is to bring joy in your souls and balance in your lives.\n\nNow, my first task as your Spiritual Leader, is to officially announces you that on the 23th of September 2015 at 11.11 GMT will be the Graduation Day, or in short the G-Day. I call it the Graduation Day, because on that specific day we will celebrate the end of your childhood as a human race and the beginning of your adulthood period.  On that day, at that specific hour, I'll give to all of you, brothers and sisters, the invitation to heal your souls, because on that date, at that specific hour, all the people on Planet Earth will drop the weapons and will embrace each other with great love and compassion, be it his dearest friend, a complete stranger or his most fierce enemy. \nAnd in an instant, your souls will be brought to life, because today, my beloved children, your souls are dying slowly. Only one tiny grain of Faith you've preserved,  spared  you from a catastrophe at planetary level and allowed me to arrive here, just in time to avoid that. You must endure for the damage you've  done till nowbut my role is to alleviate your sorrow and to inspire you to make a better Earth for you and for the future generations.\nUntil now, on your own, you built Hell on Earth because you are infantile and misguided. Now you know what the Hell is. \nFrom now on, you'll start to build the Heaven on Earth because you reach the maturity, and you will know what the Heaven is.\nIt's not an overnight task or an easy onebut no matter how difficult might be, your heart will sing in joy and your soul will celebrate, because you build the Heaven directly on Earth when you are alive and not in the skies when you're dead. \nDear fighters on all wars existing now on Earth, I know you're brave men, whichever side you've taken, and I'll explain later to all the world how important was your role in the evolution of humanity,  but now I announce you that your task is accomplished and you don't need the weapons anymore. You must know, that I love you all and I don’t care what you did beforebut what you do from now on. \nWhat you did until now was part of your learning process as a child human race. \nI ask now the governments you fought against, to pardon you, and to your victim to forgive you because being in Hell for that long you've already been punished. \nIt’s not a time to revenge but a time of compassion and joy. \nYou are suffering too much and for so long.\nEnough is enough. \n I am not here to bring chaosbut order, not punishment but love. I am not here to overthrown governmentsbut to cooperate with them. Not to divide but to unite the human race, in order to face together all provocations that are to come. Because, as in everyday life, an adult have much more responsibilities and  much more difficult tasks to accomplish than a child. So works the Universe.\n\nYou must know that very soon, I'll take my office, so that you could see me in person, and after that, in a reasonable timeframe, I'll present to you, my beloved children, the main rules that are to be respected here on Planet Earth from now on. All of you are welcome to see me, or to talk with me. The doors of my office and the doors of my heart will be permanently open for you. \nYou will permanently find me on my office. \nI’ll never leave it and I never leave you. \nTo not rush to see me in person, because that will provoke chaos; the infrastructure is not prepared for that event of a planetary scale. I ask you to not act childish, you’re grown up now. But you may see me as you wish on your TV sets or internet. Will be 24/24 hours transmissions. Worldwide media will be here. \nBut now I have an emergency to focus on. Some of my children are in desperate situation and I must concentrate myself on that matter now. Remember, I am a human being as you are.  \nWhen the things will cools down, the touristic tours for peoples of all countries will be programmed, in order to be a beautiful experience not an exhausting one.  \n Now hurry up to bring that wonderful news to all peoples on Earth. They desperately wait for it. Translate it, share itbut do it quickly because any minute of delay means a life wasted meaningless somewhere in this beautiful world. \n\nLove and Peace my beloved children\nSorin – The Unifier",
