            "videoId": "9bZkp7q19f0",
            "textDisplay": "&quot;Dear Almighty Lord God Jesus Christ, I thank you for this day, for this is the day that the Lord has made, I will rejoice and be glad in it. \u003cbr\u003eI thank you for my being able to see, and to hear, and to speak, and to feel, and to taste of Your good creation this day and every day. \u003cbr\u003eI&#39;m blessed because you are such a loving and such\u003cbr\u003ea forgiving God, and such an understanding and caring God. \u003cbr\u003eYou have done so much for me and yet you keep on blessing me.\u003cbr\u003eForgive me this day for everything I have ever done, or ever said or ever thought \u003cbr\u003eThat was not pleasing to you. I say I am so sorry.\u003cbr\u003eI now repent and ask for your forgiveness. \u003cbr\u003ePlease keep me safe O God From all danger, hurt, and harm.\u003cbr\u003eHelp me to start this day and every day With a new attitude and plenty of gratitude. \u003cbr\u003eLet me make the best of each and every day, To clear my mind so that I can hear from you. \u003cbr\u003ePlease broaden my mind so that I can accept all things according to God&#39;s Will. Let me not whine and whimper \u003cbr\u003eOver things I have no control over, for all things are working together for my good and God&#39;s Glory. \u003cbr\u003eAnd when I&#39;m pushed beyond my limits, give me the best response, a response which says Alleluia, and \u003cbr\u003ePraise the Lord, and Thanks be unto the Most High God Almighty, I know that when I can&#39;t \u003cbr\u003epray, You listen to the prayer of my heart.\u003cbr\u003eContinue to use me to do your will. \u003cbr\u003eContinue to bless me so that I may be A blessing to others.\u003cbr\u003eKeep me strong so that I may help the weak... \u003cbr\u003eKeep me uplifted so that I may have Words of encouragement for the discouraged. \u003cbr\u003eI pray for those that are lost and can&#39;t find their way, that they come to know Jesus Christ as Lord and Savior, even through this Prayer I am now praying. \u003cbr\u003e\u003cbr\u003eI pray for those that are misjudged\u003cbr\u003eMisguided, misused, and misunderstood. \u003cbr\u003eI pray for those who don&#39;t know you intimately.\u003cbr\u003eI pray for those who will delete this prayer \u003cbr\u003ewithout sharing the Love of God with others\u003cbr\u003eI pray for those that don&#39;t believe. \u003cbr\u003eBut I thank You, that I do believe\u003cbr\u003eThat God changes people and God changes things. \u003cbr\u003eI pray for all my sisters and brothers.\u003cbr\u003eFor each and every one of the family members \u003cbr\u003eIn their households. I pray for peace, love, and joy\u003cbr\u003ein their homes; I pray that they are out of debt \u003cbr\u003eAnd that all their financial needs are met, and they have more than enough to be a blessing to others. \u003cbr\u003eI pray for every eye that reads and says this Prayer\u003cbr\u003eThat they come to know that there is no problem, no circumstance, no situation that is greater than God, for God is greater than all, God is greater in all, God is greater through all, and God is greater upon all. \u003cbr\u003eFor God, the Most High God Almighty of all the Universes is truly the Greatest of All. \u003cbr\u003e\u003cbr\u003eI pray for all my enemies, and those who have used me and abused me, and have lifted up their hands and their tongue against me. I now forgive them for all they have done. In Jesus Name, all my enemies are now forgiven, and I pray God forgiveness upon all my enemies, for they do know what they are doing, for I am a Child of God. \u003cbr\u003eSo every battle that I have ever encountered in my life is now in God&#39;s Loving hands, for You, O God fights all my battles for me. \u003cbr\u003eI pray that these words be believed, received and accepted\u003cbr\u003einto the hearts of every eye that sees them and every tongue that confesses them \u003cbr\u003ein name of Jesus Christ, I pray believing, receiving and accepting God&#39;s miracles in my life this \u003cbr\u003eday and every day, for God&#39;s Divine favor is now my heritage, in Jesus Name. Amen and Amen! It is \u003cbr\u003edone! O&#39; Praise The Lord! Alleluia!\u003cbr\u003e\u003cbr\u003eGod Bless You!! ! ! !\u003cbr\u003eJust repeat the phrase below and see how God moves!! \u003cbr\u003e\u003cbr\u003eGod I so love you and I need you. I confess that Jesus is the Christ, the Son of the Living God, my Lord, my Savior, and my King, and I confess this day and every day that I am highly FAVORED by God and man. \u003cbr\u003ePlease come into my life, Lord Jesus Christ and change my heart now!\u003cbr\u003eLet&#39;s take this Prayer around the World. \u003cbr\u003eYou will receive a miracle tomorrow.\u003cbr\u003eDon&#39;t ignore this and God will bless you. \u003cbr\u003eKnow that you are already blessed\u003cbr\u003eBy the person who sent this to you.\u003cbr\u003e\u003cbr\u003eYou never know how many people you will bring to the foot of the Cross because of you sending this e-mail out to as many people as possible, and God will say to you &#39;Well Done&#39; \u003cbr\u003e\u003cbr\u003e\u003ci\u003e_____________________________\u003c/i\u003e\u003cbr\u003eCONCENTRATE ON THIS:\u003cbr\u003e\u003cbr\u003e&quot;To get something you never had, you have to do something you never did. When God takes something from your grasp, he&#39;s not punishing youbut merely opening your hands to receive something better. The will of God will never take you where the Grace of God will not protect you. Something good will happen to you today, something that you have been waiting for to hear. Please repeat these 30 Words, &quot; Almighty Jesus Christ, my Everlasting Father, walk through my house and take away all my worries and illnesses, and please watch over and heal my family in Jesus name, Amen&quot;. His prayer is so powerful. Pass this to other people. A blessing is coming to you in form of a new job, a house, marriage or financial blessings. Do not break or ask questions. This is a test. Does God come first in your life? If so, stop what you’re doing &amp; send it to other people right now......Lets take this Prayer around the world.....And watch what God does for you. \u003cbr\u003e\u003cbr\u003eDon&#39;t stand before God empty handed. Send this out to as many people as possible now, and let this be your ministry unto God who Brings Miracles in your life today and everyday.",
            "textOriginal": "\"Dear Almighty Lord God Jesus Christ, I thank you for this day, for this is the day that the Lord has made, I will rejoice and be glad in it. \nI thank you for my being able to see, and to hear, and to speak, and to feel, and to taste of Your good creation this day and every day. \nI'm blessed because you are such a loving and such\na forgiving God, and such an understanding and caring God. \nYou have done so much for me and yet you keep on blessing me.\nForgive me this day for everything I have ever done, or ever said or ever thought \nThat was not pleasing to you. I say I am so sorry.\nI now repent and ask for your forgiveness. \nPlease keep me safe O God From all danger, hurt, and harm.\nHelp me to start this day and every day With a new attitude and plenty of gratitude. \nLet me make the best of each and every day, To clear my mind so that I can hear from you. \nPlease broaden my mind so that I can accept all things according to God's Will. Let me not whine and whimper \nOver things I have no control over, for all things are working together for my good and God's Glory. \nAnd when I'm pushed beyond my limits, give me the best response, a response which says Alleluia, and \nPraise the Lord, and Thanks be unto the Most High God Almighty, I know that when I can't \npray, You listen to the prayer of my heart.\nContinue to use me to do your will. \nContinue to bless me so that I may be A blessing to others.\nKeep me strong so that I may help the weak... \nKeep me uplifted so that I may have Words of encouragement for the discouraged. \nI pray for those that are lost and can't find their way, that they come to know Jesus Christ as Lord and Savior, even through this Prayer I am now praying. \n\nI pray for those that are misjudged\nMisguided, misused, and misunderstood. \nI pray for those who don't know you intimately.\nI pray for those who will delete this prayer \nwithout sharing the Love of God with others\nI pray for those that don't believe. \nBut I thank You, that I do believe\nThat God changes people and God changes things. \nI pray for all my sisters and brothers.\nFor each and every one of the family members \nIn their households. I pray for peace, love, and joy\nin their homes; I pray that they are out of debt \nAnd that all their financial needs are met, and they have more than enough to be a blessing to others. \nI pray for every eye that reads and says this Prayer\nThat they come to know that there is no problem, no circumstance, no situation that is greater than God, for God is greater than all, God is greater in all, God is greater through all, and God is greater upon all. \nFor God, the Most High God Almighty of all the Universes is truly the Greatest of All. \n\nI pray for all my enemies, and those who have used me and abused me, and have lifted up their hands and their tongue against me. I now forgive them for all they have done. In Jesus Name, all my enemies are now forgiven, and I pray God forgiveness upon all my enemies, for they do know what they are doing, for I am a Child of God. \nSo every battle that I have ever encountered in my life is now in God's Loving hands, for You, O God fights all my battles for me. \nI pray that these words be believed, received and accepted\ninto the hearts of every eye that sees them and every tongue that confesses them \nin name of Jesus Christ, I pray believing, receiving and accepting God's miracles in my life this \nday and every day, for God's Divine favor is now my heritage, in Jesus Name. Amen and Amen! It is \ndone! O' Praise The Lord! Alleluia!\n\nGod Bless You!! ! ! !\nJust repeat the phrase below and see how God moves!! \n\nGod I so love you and I need you. I confess that Jesus is the Christ, the Son of the Living God, my Lord, my Savior, and my King, and I confess this day and every day that I am highly FAVORED by God and man. \nPlease come into my life, Lord Jesus Christ and change my heart now!\nLet's take this Prayer around the World. \nYou will receive a miracle tomorrow.\nDon't ignore this and God will bless you. \nKnow that you are already blessed\nBy the person who sent this to you.\n\nYou never know how many people you will bring to the foot of the Cross because of you sending this e-mail out to as many people as possible, and God will say to you 'Well Done' \n\n_______________________________\nCONCENTRATE ON THIS:\n\n\"To get something you never had, you have to do something you never did. When God takes something from your grasp, he's not punishing youbut merely opening your hands to receive something better. The will of God will never take you where the Grace of God will not protect you. Something good will happen to you today, something that you have been waiting for to hear. Please repeat these 30 Words, \" Almighty Jesus Christ, my Everlasting Father, walk through my house and take away all my worries and illnesses, and please watch over and heal my family in Jesus name, Amen\". His prayer is so powerful. Pass this to other people. A blessing is coming to you in form of a new job, a house, marriage or financial blessings. Do not break or ask questions. This is a test. Does God come first in your life? If so, stop what you’re doing & send it to other people right now......Lets take this Prayer around the world.....And watch what God does for you. \n\nDon't stand before God empty handed. Send this out to as many people as possible now, and let this be your ministry unto God who Brings Miracles in your life today and everyday.",
