          "snippet": {
            "videoId": "9bZkp7q19f0",
            "textDisplay": "9 Reasons Why You Need To Calm The Fuck Down About Ebola In America\u003cbr\u003e1. America has the infrastructure and technology to contain an outbreak. \u003cbr\u003e2. It’s actually pretty difficult to get infected. \u003cbr\u003e3. Contracting Ebola doesn&#39;t lead to automatic death. You can beat it. \u003cbr\u003e4. Ebola isn&#39;t nearly as deadly as many other diseases. \u003cbr\u003e5. Ebola is not airborne. \u003cbr\u003e6. This isn&#39;t the first outbreak of Ebola, it’s containable. \u003cbr\u003e7. Ebola has spread in Africa because of politics and culture, not because it’s impossible to contain. \u003cbr\u003e8. America has bigger health issues to concentrate on. \u003cbr\u003e9. It’s a distraction from all of the good things happening around you.",
