          "snippet": {
            "videoId": "9bZkp7q19f0",
            "textDisplay": "Mr. and Mrs. Dursley, of number four, Privet Drive, were proud to say\u003cbr\u003ethat they were perfectly normal, thank you very much. They were the last\u003cbr\u003epeople you&#39;d expect to be involved in anything strange or mysterious,\u003cbr\u003ebecause they just didn&#39;t hold with such nonsense.\u003cbr\u003eMr. Dursley was the director of a firm called Grunnings, which made\u003cbr\u003edrills. He was a big, beefy man with hardly any neck, although he did\u003cbr\u003ehave a very large mustache. Mrs. Dursley was thin and blonde and had\u003cbr\u003enearly twice the usual amount of neck, which came in very useful as she\u003cbr\u003espent so much of her time craning over garden fences, spying on the\u003cbr\u003eneighbors. The Dursleys had a small son called Dudley and in their\u003cbr\u003eopinion there was no finer boy anywhere.\u003cbr\u003eThe Dursleys had everything they wantedbut they also had a secret, and\u003cbr\u003etheir greatest fear was that somebody would discover it. They didn&#39;t\u003cbr\u003ethink they could bear it if anyone found out about the Potters. Mrs.\u003cbr\u003ePotter was Mrs. Dursley&#39;s sisterbut they hadn&#39;t met for several years;\u003cbr\u003ein fact, Mrs. Dursley pretended she didn&#39;t have a sister, because her\u003cbr\u003esister and her good-for-nothing husband were as unDursleyish as it was\u003cbr\u003epossible to be. The Dursleys shuddered to think what the neighbors would\u003cbr\u003esay if the Potters arrived in the street. The Dursleys knew that the\u003cbr\u003ePotters had a small son, toobut they had never even seen him. This boy\u003cbr\u003ewas another good reason for keeping the Potters away; they didn&#39;t want\u003cbr\u003eDudley mixing with a child like that.\u003cbr\u003eWhen Mr. and Mrs. Dursley woke up on the dull, gray Tuesday our story\u003cbr\u003estarts, there was nothing about the cloudy sky outside to suggest that\u003cbr\u003estrange and mysterious things would soon be happening all over the\u003cbr\u003ecountry. Mr. Dursley hummed as he picked out his most boring tie for\u003cbr\u003ework, and Mrs. Dursley gossiped away happily as she wrestled a screaming\u003cbr\u003eDudley into his high chair.\u003cbr\u003eNone of them noticed a large, tawny owl flutter past the window.\u003cbr\u003eAt half past eight, Mr. Dursley picked up his briefcase, pecked Mrs.\u003cbr\u003eDursley on the cheek, and tried to kiss Dudley good-bye but missed,\u003cbr\u003ebecause Dudley was now having a tantrum and throwing his cereal at the\u003cbr\u003ewalls. &quot;Little tyke,&quot; chortled Mr. Dursley as he left the house. He got\u003cbr\u003einto his car and backed out of number four&#39;s drive.\u003cbr\u003eIt was on the corner of the street that he noticed the first sign of\u003cbr\u003esomething peculiar -- a cat reading a map. For a second, Mr. Dursley\u003cbr\u003edidn&#39;t realize what he had seen -- then he jerked his head around to\u003cbr\u003elook again. There was a tabby cat standing on the corner of Privet\u003cbr\u003eDrivebut there wasn&#39;t a map in sight. What could he have been thinking\u003cbr\u003eof? It must have been a trick of the light. Mr. Dursley blinked and\u003cbr\u003estared at the cat. It stared back. As Mr. Dursley drove around the\u003cbr\u003ecorner and up the road, he watched the cat in his mirror. It was now\u003cbr\u003ereading the sign that said Privet Drive -- no, looking at the sign; cats\u003cbr\u003ecouldn&#39;t read maps or signs. Mr. Dursley gave himself a little shake and\u003cbr\u003eput the cat out of his mind. As he drove toward town he thought of\u003cbr\u003enothing except a large order of drills he was hoping to get that day.\u003cbr\u003eBut on the edge of town, drills were driven out of his mind by something\u003cbr\u003eelse. As he sat in the usual morning traffic jam, he couldn&#39;t help\u003cbr\u003enoticing that there seemed to be a lot of strangely dressed people\u003cbr\u003eabout. People in cloaks. Mr. Dursley couldn&#39;t bear people who dressed in\u003cbr\u003efunny clothes -- the getups you saw on young people! He supposed this\u003cbr\u003ewas some stupid new fashion. He drummed his fingers on the steering\u003cbr\u003ewheel and his eyes fell on a huddle of these weirdos standing quite\u003cbr\u003eclose by. They were whispering excitedly together. Mr. Dursley was\u003cbr\u003eenraged to see that a couple of them weren&#39;t young at all; why, that man\u003cbr\u003ehad to be older than he was, and wearing an emerald-green cloak! The\u003cbr\u003enerve of him! But then it struck Mr. Dursley that this was probably some\u003cbr\u003esilly stunt -- these people were obviously collecting for something...\u003cbr\u003eyes, that would be it. The traffic moved on and a few minutes later, Mr.\u003cbr\u003eDursley arrived in the Grunnings parking lot, his mind back on drills.\u003cbr\u003eMr. Dursley always sat with his back to the window in his office on the\u003cbr\u003eninth floor. If he hadn&#39;t, he might have found it harder to concentrate\u003cbr\u003eon drills that morning. He didn&#39;t see the owls swoop ing past in broad\u003cbr\u003edaylight, though people down in the street did; they pointed and gazed\u003cbr\u003eopen- mouthed as owl after owl sped overhead. Most of them had never\u003cbr\u003eseen an owl even at nighttime. Mr. Dursley, however, had a perfectly\u003cbr\u003enormal, owl-free morning. He yelled at five different people. He made\u003cbr\u003eseveral important telephone calls and shouted a bit more. He was in a\u003cbr\u003every good mood until lunchtime, when he thought he&#39;d stretch his legs\u003cbr\u003eand walk across the road to buy himself a bun from the bakery.\u003cbr\u003eHe&#39;d forgotten all about the people in cloaks until he passed a group of\u003cbr\u003ethem next to the baker&#39;s. He eyed them angrily as he passed. He didn&#39;t\u003cbr\u003eknow whybut they made him uneasy. This bunch were whispering\u003cbr\u003eexcitedly, too, and he couldn&#39;t see a single collecting tin. It was on\u003cbr\u003ehis way back past them, clutching a large doughnut in a bag, that he\u003cbr\u003ecaught a few words of what they were saying.\u003cbr\u003e&quot;The Potters, that&#39;s right, that&#39;s what I heard yes, their son, Harry&quot;\u003cbr\u003eMr. Dursley stopped dead. Fear flooded him. He looked back at the\u003cbr\u003ewhisperers as if he wanted to say something to thembut thought better\u003cbr\u003eof it.\u003cbr\u003eHe dashed back across the road, hurried up to his office, snapped at his\u003cbr\u003esecretary not to disturb him, seized his telephone, and had almost\u003cbr\u003efinished dialing his home number when he changed his mind. He put the\u003cbr\u003ereceiver back down and stroked his mustache, thinking... no, he was\u003cbr\u003ebeing stupid. Potter wasn&#39;t such an unusual name. He was sure there were\u003cbr\u003elots of people called Potter who had a son called Harry. Come to think\u003cbr\u003eof it, he wasn&#39;t even sure his nephew was called Harry. He&#39;d never even\u003cbr\u003eseen the boy. It might have been Harvey. Or Harold. There was no point\u003cbr\u003ein worrying Mrs. Dursley; she always got so upset at any mention of her\u003cbr\u003esister. He didn&#39;t blame her -- if he&#39;d had a sister like that... but all\u003cbr\u003ethe same, those people in cloaks...\u003cbr\u003eHe found it a lot harder to concentrate on drills that afternoon and\u003cbr\u003ewhen he left the building at five o&#39;clock, he was still so worried that\u003cbr\u003ehe walked straight into someone just outside the door.\u003cbr\u003e&quot;Sorry,&quot; he grunted, as the tiny old man stumbled and almost fell. It\u003cbr\u003ewas a few seconds before Mr. Dursley realized that the man was wearing a\u003cbr\u003eviolet cloak. He didn&#39;t seem at all upset at being almost knocked to the\u003cbr\u003eground. On the contrary, his face split into a wide smile and he said in\u003cbr\u003ea squeaky voice that made passersby stare, &quot;Don&#39;t be sorry, my dear sir,\u003cbr\u003efor nothing could upset me today! Rejoice, for You-Know-Who has gone at\u003cbr\u003elast! Even Muggles like yourself should be celebrating, this happy,\u003cbr\u003ehappy day!&quot;\u003cbr\u003eAnd the old man hugged Mr. Dursley around the middle and walked off.\u003cbr\u003eMr. Dursley stood rooted to the spot. He had been hugged by a complete\u003cbr\u003estranger. He also thought he had been called a Muggle, whatever that\u003cbr\u003ewas. He was rattled. He hurried to his car and set off for home, hoping\u003cbr\u003ehe was imagining things, which he had never hoped before, because he\u003cbr\u003edidn&#39;t approve of imagination.\u003cbr\u003eAs he pulled into the driveway of number four, the first thing he saw --\u003cbr\u003eand it didn&#39;t improve his mood -- was the tabby cat he&#39;d spotted that\u003cbr\u003emorning. It was now sitting on his garden wall. He was sure it was the\u003cbr\u003esame one; it had the same markings around its eyes.\u003cbr\u003e&quot;Shoo!&quot; said Mr. Dursley loudly. The cat didn&#39;t move. It just gave him a\u003cbr\u003estern look. Was this normal cat behavior? Mr. Dursley wondered. Trying\u003cbr\u003eto pull himself together, he let himself into the house. He was still\u003cbr\u003edetermined not to mention anything to his wife.\u003cbr\u003eMrs. Dursley had had a nice, normal day. She told him over dinner all\u003cbr\u003eabout Mrs. Next Door&#39;s problems with her daughter and how Dudley had\u003cbr\u003elearned a new word (&quot;Won&#39;t!&quot;). Mr. Dursley tried to act normally. When\u003cbr\u003eDudley had been put to bed, he went into the living room in time to\u003cbr\u003ecatch the last report on the evening news:\u003cbr\u003e&quot;And finally, bird-watchers everywhere have reported that the nation&#39;s\u003cbr\u003eowls have been behaving very unusually today. Although owls normally\u003cbr\u003ehunt at night and are hardly ever seen in daylight, there have been\u003cbr\u003ehundreds of sightings of these birds flying in every direction since\u003cbr\u003esunrise. Experts are unable to explain why the owls have suddenly\u003cbr\u003echanged their sleeping pattern.&quot; The newscaster allowed himself a grin.\u003cbr\u003e&quot;Most mysterious. And now, over to Jim McGuffin with the weather. Going\u003cbr\u003eto be any more showers of owls tonight, Jim?&quot;\u003cbr\u003e&quot;Well, Ted,&quot; said the weatherman, &quot;I don&#39;t know about thatbut it&#39;s not\u003cbr\u003eonly the owls that have been acting oddly today. Viewers as far apart as\u003cbr\u003eKent, Yorkshire, and Dundee have been phoning in to tell me that instead\u003cbr\u003eof the rain I promised yesterday, they&#39;ve had a downpour of shooting\u003cbr\u003estars! Perhaps people have been celebrating Bonfire Night early -- it&#39;s\u003cbr\u003enot until next week, folks! But I can promise a wet night tonight.&quot;\u003cbr\u003eMr. Dursley sat frozen in his armchair. Shooting stars all over Britain?\u003cbr\u003eOwls flying by daylight? Mysterious people in cloaks all over the place?\u003cbr\u003eAnd a whisper, a whisper about the Potters...\u003cbr\u003eMrs. Dursley came into the living room carrying two cups of tea. It was\u003cbr\u003eno good. He&#39;d have to say something to her. He cleared his throat\u003cbr\u003enervously. &quot;Er -- Petunia, dear -- you haven&#39;t heard from your sister\u003cbr\u003elately, have you?&quot;\u003cbr\u003eAs he had expected, Mrs. Dursley looked shocked and angry. After all,\u003cbr\u003ethey normally pretended she didn&#39;t have a sister.\u003cbr\u003e&quot;No,&quot; she said sharply. &quot;Why?&quot;\u003cbr\u003e&quot;Funny stuff on the news,&quot; Mr. Dursley mumbled. &quot;Owls... shooting\u003cbr\u003estars... and there were a lot of funny-looking people in town today...&quot;\u003cbr\u003e&quot;So?&quot; snapped Mrs. Dursley.\u003cbr\u003e&quot;Well, I just thought... maybe... it was something to do with... you\u003cbr\u003eknow... her crowd.&quot;\u003cbr\u003eMrs. Dursley sipped her tea through pursed lips. Mr. Dursley wondered\u003cbr\u003ewhether he dared tell her he&#39;d heard the name &quot;Potter.&quot; He decided he\u003cbr\u003edidn&#39;t dare. Instead he said, as casually as he could, &quot;Their son --\u003cbr\u003ehe&#39;d be about Dudley&#39;s age now, wouldn&#39;t he?&quot;\u003cbr\u003e&quot;I suppose so,&quot; said Mrs. Dursley stiffly.\u003cbr\u003e&quot;What&#39;s his name again? Howard, isn&#39;t it?&quot;\u003cbr\u003e&quot;Harry. Nasty, common name, if you ask me.&quot;\u003cbr\u003e&quot;Oh, yes,&quot; said Mr. Dursley, his heart sinking horribly. &quot;Yes, I quite\u003cbr\u003eagree.&quot;\u003cbr\u003eHe didn&#39;t say another word on the subject as they went upstairs to bed.\u003cbr\u003eWhile Mrs. Dursley was in the bathroom, Mr. Dursley crept to the bedroom\u003cbr\u003ewindow and peered down into the front garden. The cat was still there.\u003cbr\u003eIt was staring down Privet Drive as though it were waiting for\u003cbr\u003esomething.\u003cbr\u003eWas he imagining things? Could all this have anything to do with the\u003cbr\u003ePotters? If it did... if it got out that they were related to a pair of\u003cbr\u003e-- well, he didn&#39;t think he could bear it.\u003cbr\u003eThe Dursleys got into bed. Mrs. Dursley fell asleep quickly but Mr.\u003cbr\u003eDursley lay awake, turning it all over in his mind. His last, comforting\u003cbr\u003ethought before he fell asleep was that even if the Potters were\u003cbr\u003einvolved, there was no reason for them to come near him and Mrs.\u003cbr\u003eDursley. The Potters knew very well what he and Petunia thought about\u003cbr\u003ethem and their kind.... He couldn&#39;t see how he and Petunia could get\u003cbr\u003emixed up in anything that might be going on -- he yawned and turned over\u003cbr\u003e-- it couldn&#39;t affect them....\u003cbr\u003eHow very wrong he was.\u003cbr\u003eMr. Dursley might have been drifting into an uneasy sleepbut the cat\u003cbr\u003eon the wall outside was showing no sign of sleepiness. It was sitting as\u003cbr\u003estill as a statue, its eyes fixed unblinkingly on the far corner of\u003cbr\u003ePrivet Drive. It didn&#39;t so much as quiver when a car door slammed on the\u003cbr\u003enext street, nor when two owls swooped overhead. In fact, it was nearly\u003cbr\u003emidnight before the cat moved at all.\u003cbr\u003eA man appeared on the corner the cat had been watching, appeared so\u003cbr\u003esuddenly and silently you&#39;d have thought he&#39;d just popped out of the\u003cbr\u003eground. The cat&#39;s tail twitched and its eyes narrowed.\u003cbr\u003eNothing like this man had ever been seen on Privet Drive. He was tall,\u003cbr\u003ethin, and very old, judging by the silver of his hair and beard, which\u003cbr\u003ewere both long enough to tuck into his belt. He was wearing long robes,\u003cbr\u003ea purple cloak that swept the ground, and high-heeled, buckled boots.\u003cbr\u003eHis blue eyes were light, bright, and sparkling behind half-moon\u003cbr\u003espectacles and his nose was very long and crooked, as though it had been\u003cbr\u003ebroken at least twice. This man&#39;s name was Albus Dumbledore.\u003cbr\u003eAlbus Dumbledore didn&#39;t seem to realize that he had just arrived in a\u003cbr\u003estreet where everything from his name to his boots was unwelcome. He was\u003cbr\u003ebusy rummaging in his cloak, looking for something. But he did seem to\u003cbr\u003erealize he was being watched, because he looked up suddenly at the cat,\u003cbr\u003ewhich was still staring at him from the other end of the street. For\u003cbr\u003esome reason, the sight of the cat seemed to amuse him. He chuckled and\u003cbr\u003emuttered, &quot;I should have known.&quot;\u003cbr\u003eHe found what he was looking for in his inside pocket. It seemed to be a\u003cbr\u003esilver cigarette lighter. He flicked it open, held it up in the air, and\u003cbr\u003eclicked it. The nearest street lamp went out with a little pop. He\u003cbr\u003eclicked it again -- the next lamp flickered into darkness. Twelve times\u003cbr\u003ehe clicked the Put-Outer, until the only lights left on the whole street\u003cbr\u003ewere two tiny pinpricks in the distance, which were the eyes of the cat\u003cbr\u003ewatching him. If anyone looked out of their window now, even beady-eyed\u003cbr\u003eMrs. Dursley, they wouldn&#39;t be able to see anything that was happening\u003cbr\u003edown on the pavement. Dumbledore slipped the Put-Outer back inside his\u003cbr\u003ecloak and set off down the street toward number four, where he sat down\u003cbr\u003eon the wall next to the cat. He didn&#39;t look at itbut after a moment he\u003cbr\u003espoke to it.\u003cbr\u003e&quot;Fancy seeing you here, Professor McGonagall.&quot;\u003cbr\u003eHe turned to smile at the tabbybut it had gone. Instead he was smiling\u003cbr\u003eat a rather severe-looking woman who was wearing square glasses exactly\u003cbr\u003ethe shape of the markings the cat had had around its eyes. She, too, was\u003cbr\u003ewearing a cloak, an emerald one. Her black hair was drawn into a tight\u003cbr\u003ebun. She looked distinctly ruffled.\u003cbr\u003e&quot;How did you know it was me?&quot; she asked.\u003cbr\u003e&quot;My dear Professor, I &#39;ve never seen a cat sit so stiffly.&quot;\u003cbr\u003e&quot;You&#39;d be stiff if you&#39;d been sitting on a brick wall all day,&quot; said\u003cbr\u003eProfessor McGonagall.\u003cbr\u003e&quot;All day? When you could have been celebrating? I must have passed a\u003cbr\u003edozen feasts and parties on my way here.&quot;\u003cbr\u003eProfessor McGonagall sniffed angrily.\u003cbr\u003e&quot;Oh yes, everyone&#39;s celebrating, all right,&quot; she said impatiently.\u003cbr\u003e&quot;You&#39;d think they&#39;d be a bit more carefulbut no -- even the Muggles\u003cbr\u003ehave noticed something&#39;s going on. It was on their news.&quot; She jerked her\u003cbr\u003ehead back at the Dursleys&#39; dark living-room window. &quot;I heard it. Flocks\u003cbr\u003eof owls... shooting stars.... Well, they&#39;re not completely stupid. They\u003cbr\u003ewere bound to notice something. Shooting stars down in Kent -- I&#39;ll bet\u003cbr\u003ethat was Dedalus Diggle. He never had much sense.&quot;\u003cbr\u003e&quot;You can&#39;t blame them,&quot; said Dumbledore gently. &quot;We&#39;ve had precious\u003cbr\u003elittle to celebrate for eleven years.&quot;\u003cbr\u003e&quot;I know that,&quot; said Professor McGonagall irritably. &quot;But that&#39;s no\u003cbr\u003ereason to lose our heads. People are being downright careless, out on\u003cbr\u003ethe streets in broad daylight, not even dressed in Muggle clothes,\u003cbr\u003eswapping rumors.&quot;\u003cbr\u003eShe threw a sharp, sideways glance at Dumbledore here, as though hoping\u003cbr\u003ehe was going to tell her somethingbut he didn&#39;t, so she went on. &quot;A\u003cbr\u003efine thing it would be if, on the very day YouKnow-Who seems to have\u003cbr\u003edisappeared at last, the Muggles found out about us all. I suppose he\u003cbr\u003ereally has gone, Dumbledore?&quot;\u003cbr\u003e&quot;It certainly seems so,&quot; said Dumbledore. &quot;We have much to be thankful\u003cbr\u003efor. Would you care for a lemon drop?&quot;\u003cbr\u003e&quot;A what?&quot;\u003cbr\u003e&quot;A lemon drop. They&#39;re a kind of Muggle sweet I&#39;m rather fond of&quot;\u003cbr\u003e&quot;No, thank you,&quot; said Professor McGonagall coldly, as though she didn&#39;t\u003cbr\u003ethink this was the moment for lemon drops. &quot;As I say, even if\u003cbr\u003eYou-Know-Who has gone -&quot;\u003cbr\u003e&quot;My dear Professor, surely a sensible person like yourself can call him\u003cbr\u003eby his name? All this &#39;You- Know-Who&#39; nonsense -- for eleven years I\u003cbr\u003ehave been trying to persuade people to call him by his proper name:\u003cbr\u003eVoldemort.&quot; Professor McGonagall flinchedbut Dumbledore, who was\u003cbr\u003eunsticking two lemon drops, seemed not to notice. &quot;It all gets so\u003cbr\u003econfusing if we keep saying &#39;You-Know-Who.&#39; I have never seen any reason\u003cbr\u003eto be frightened of saying Voldemort&#39;s name.\u003cbr\u003e&quot;I know you haven &#39;t, said Professor McGonagall, sounding half\u003cbr\u003eexasperated, half admiring. &quot;But you&#39;re different. Everyone knows you&#39;re\u003cbr\u003ethe only one You-Know- oh, all right, Voldemort, was frightened of.&quot;\u003cbr\u003e&quot;You flatter me,&quot; said Dumbledore calmly. &quot;Voldemort had powers I will\u003cbr\u003enever have.&quot;\u003cbr\u003e&quot;Only because you&#39;re too -- well -- noble to use them.&quot;\u003cbr\u003e&quot;It&#39;s lucky it&#39;s dark. I haven&#39;t blushed so much since Madam Pomfrey\u003cbr\u003etold me she liked my new earmuffs.&quot;\u003cbr\u003eProfessor McGonagall shot a sharp look at Dumbledore and said, &quot;The owls\u003cbr\u003eare nothing next to the rumors that are flying around. You know what\u003cbr\u003eeveryone&#39;s saying? About why he&#39;s disappeared? About what finally\u003cbr\u003estopped him?&quot;\u003cbr\u003eIt seemed that Professor McGonagall had reached the point she was most\u003cbr\u003eanxious to discuss, the real reason she had been waiting on a cold, hard\u003cbr\u003ewall all day, for neither as a cat nor as a woman had she fixed\u003cbr\u003eDumbledore with such a piercing stare as she did now. It was plain that\u003cbr\u003ewhatever &quot;everyone&quot; was saying, she was not going to believe it until\u003cbr\u003eDumbledore told her it was true. Dumbledore, however, was choosing\u003cbr\u003eanother lemon drop and did not answer.\u003cbr\u003e&quot;What they&#39;re saying,&quot; she pressed on, &quot;is that last night Voldemort\u003cbr\u003eturned up in Godric&#39;s Hollow. He went to find the Potters. The rumor is\u003cbr\u003ethat Lily and James Potter are -- are -- that they&#39;re -- dead. &quot;\u003cbr\u003eDumbledore bowed his head. Professor McGonagall gasped.\u003cbr\u003e&quot;Lily and James... I can&#39;t believe it... I didn&#39;t want to believe it...\u003cbr\u003eOh, Albus...&quot;\u003cbr\u003eDumbledore reached out and patted her on the shoulder. &quot;I know... I\u003cbr\u003eknow...&quot; he said heavily.\u003cbr\u003eProfessor McGonagall&#39;s voice trembled as she went on. &quot;That&#39;s not all.\u003cbr\u003eThey&#39;re saying he tried to kill the Potter&#39;s son, Harry. But -- he\u003cbr\u003ecouldn&#39;t. He couldn&#39;t kill that little boy. No one knows why, or how,\u003cbr\u003ebut they&#39;re saying that when he couldn&#39;t kill Harry Potter, Voldemort&#39;s\u003cbr\u003epower somehow broke -- and that&#39;s why he&#39;s gone.\u003cbr\u003eDumbledore nodded glumly.\u003cbr\u003e&quot;It&#39;s -- it&#39;s true?&quot; faltered Professor McGonagall. &quot;After all he&#39;s\u003cbr\u003edone... all the people he&#39;s killed... he couldn&#39;t kill a little boy?\u003cbr\u003eIt&#39;s just astounding... of all the things to stop him... but how in the\u003cbr\u003ename of heaven did Harry survive?&quot;\u003cbr\u003e&quot;We can only guess,&quot; said Dumbledore. &quot;We may never know.&quot;\u003cbr\u003eProfessor McGonagall pulled out a lace handkerchief and dabbed at her\u003cbr\u003eeyes beneath her spectacles. Dumbledore gave a great sniff as he took a\u003cbr\u003egolden watch from his pocket and examined it. It was a very odd watch.\u003cbr\u003eIt had twelve hands but no numbers; instead, little planets were moving\u003cbr\u003earound the edge. It must have made sense to Dumbledore, though, because\u003cbr\u003ehe put it back in his pocket and said, &quot;Hagrid&#39;s late. I suppose it was\u003cbr\u003ehe who told you I&#39;d be here, by the way?&quot;\u003cbr\u003e&quot;Yes,&quot; said Professor McGonagall. &quot;And I don&#39;t suppose you&#39;re going to\u003cbr\u003etell me why you&#39;re here, of all places?&quot;\u003cbr\u003e&quot;I&#39;ve come to bring Harry to his aunt and uncle. They&#39;re the only family\u003cbr\u003ehe has left now.&quot;\u003cbr\u003e&quot;You don&#39;t mean -- you can&#39;t mean the people who live here?&quot; cried\u003cbr\u003eProfessor McGonagall, jumping to her feet and pointing at number four.\u003cbr\u003e&quot;Dumbledore -- you can&#39;t. I&#39;ve been watching them all day. You couldn&#39;t\u003cbr\u003efind two people who are less like us. And they&#39;ve got this son -- I saw\u003cbr\u003ehim kicking his mother all the way up the street, screaming for sweets.\u003cbr\u003eHarry Potter come and live here!&quot;\u003cbr\u003e&quot;It&#39;s the best place for him,&quot; said Dumbledore firmly. &quot;His aunt and\u003cbr\u003euncle will be able to explain everything to him when he&#39;s older. I&#39;ve\u003cbr\u003ewritten them a letter.&quot;\u003cbr\u003e&quot;A letter?&quot; repeated Professor McGonagall faintly, sitting back down on\u003cbr\u003ethe wall. &quot;Really, Dumbledore, you think you can explain all this in a\u003cbr\u003eletter? These people will never understand him! He&#39;ll be famous -- a\u003cbr\u003elegend -- I wouldn&#39;t be surprised if today was known as Harry Potter day\u003cbr\u003ein the future -- there will be books written about Harry -- every child\u003cbr\u003ein our world will know his name!&quot;\u003cbr\u003e&quot;Exactly,&quot; said Dumbledore, looking very seriously over the top of his\u003cbr\u003ehalf-moon glasses. &quot;It would be enough to turn any boy&#39;s head. Famous\u003cbr\u003ebefore he can walk and talk! Famous for something he won&#39;t even\u003cbr\u003eremember! CarA you see how much better off he&#39;ll be, growing up away\u003cbr\u003efrom all that until he&#39;s ready to take it?&quot;\u003cbr\u003eProfessor McGonagall opened her mouth, changed her mind, swallowed, and\u003cbr\u003ethen said, &quot;Yes -- yes, you&#39;re right, of course. But how is the boy\u003cbr\u003egetting here, Dumbledore?&quot; She eyed his cloak suddenly as though she\u003cbr\u003ethought he might be hiding Harry underneath it.\u003cbr\u003e&quot;Hagrid&#39;s bringing him.&quot;\u003cbr\u003e&quot;You think it -- wise -- to trust Hagrid with something as important as\u003cbr\u003ethis?&quot;\u003cbr\u003eI would trust Hagrid with my life,&quot; said Dumbledore.\u003cbr\u003e&quot;I&#39;m not saying his heart isn&#39;t in the right place,&quot; said Professor\u003cbr\u003eMcGonagall grudgingly, &quot;but you can&#39;t pretend he&#39;s not careless. He does\u003cbr\u003etend to -- what was that?&quot;\u003cbr\u003eA low rumbling sound had broken the silence around them. It grew\u003cbr\u003esteadily louder as they looked up and down the street for some sign of a\u003cbr\u003eheadlight; it swelled to a roar as they both looked up at the sky -- and\u003cbr\u003ea huge motorcycle fell out of the air and landed on the road in front of\u003cbr\u003ethem.\u003cbr\u003eIf the motorcycle was huge, it was nothing to the man sitting astride\u003cbr\u003eit. He was almost twice as tall as a normal man and at least five times\u003cbr\u003eas wide. He looked simply too big to be allowed, and so wild - long\u003cbr\u003etangles of bushy black hair and beard hid most of his face, he had hands\u003cbr\u003ethe size of trash can lids, and his feet in their leather boots were\u003cbr\u003elike baby dolphins. In his vast, muscular arms he was holding a bundle\u003cbr\u003eof blankets.\u003cbr\u003e&quot;Hagrid,&quot; said Dumbledore, sounding relieved. &quot;At last. And where did\u003cbr\u003eyou get that motorcycle?&quot;\u003cbr\u003e&quot;Borrowed it, Professor Dumbledore, sit,&quot; said the giant, climbing\u003cbr\u003ecarefully off the motorcycle as he spoke. &quot;Young Sirius Black lent it to\u003cbr\u003eme. I&#39;ve got him, sir.&quot;\u003cbr\u003e&quot;No problems, were there?&quot;\u003cbr\u003e&quot;No, sir -- house was almost destroyedbut I got him out all right\u003cbr\u003ebefore the Muggles started swarmin&#39; around. He fell asleep as we was\u003cbr\u003eflyin&#39; over Bristol.&quot;\u003cbr\u003eDumbledore and Professor McGonagall bent forward over the bundle of\u003cbr\u003eblankets. Inside, just visible, was a baby boy, fast asleep. Under a\u003cbr\u003etuft of jet-black hair over his forehead they could see a curiously\u003cbr\u003eshaped cut, like a bolt of lightning.\u003cbr\u003e&quot;Is that where -?&quot; whispered Professor McGonagall.\u003cbr\u003e&quot;Yes,&quot; said Dumbledore. &quot;He&#39;ll have that scar forever.&quot;\u003cbr\u003e&quot;Couldn&#39;t you do something about it, Dumbledore?&quot;\u003cbr\u003e&quot;Even if I could, I wouldn&#39;t. Scars can come in handy. I have one myself\u003cbr\u003eabove my left knee that is a perfect map of the London Underground. Well\u003cbr\u003e-- give him here, Hagrid -- we&#39;d better get this over with.&quot;\u003cbr\u003eDumbledore took Harry in his arms and turned toward the Dursleys&#39; house.\u003cbr\u003e&quot;Could I -- could I say good-bye to him, sir?&quot; asked Hagrid. He bent his\u003cbr\u003egreat, shaggy head over Harry and gave him what must have been a very\u003cbr\u003escratchy, whiskery kiss. Then, suddenly, Hagrid let out a howl like a\u003cbr\u003ewounded dog.\u003cbr\u003e&quot;Shhh!&quot; hissed Professor McGonagall, &quot;you&#39;ll wake the Muggles!&quot;\u003cbr\u003e&quot;S-s-sorry,&quot; sobbed Hagrid, taking out a large, spotted handkerchief and\u003cbr\u003eburying his face in it. &quot;But I c-c-can&#39;t stand it -- Lily an&#39; James dead\u003cbr\u003e-- an&#39; poor little Harry off ter live with Muggles -&quot;\u003cbr\u003e&quot;Yes, yes, it&#39;s all very sadbut get a grip on yourself, Hagrid, or\u003cbr\u003ewe&#39;ll be found,&quot; Professor McGonagall whispered, patting Hagrid gingerly\u003cbr\u003eon the arm as Dumbledore stepped over the low garden wall and walked to\u003cbr\u003ethe front door. He laid Harry gently on the doorstep, took a letter out\u003cbr\u003eof his cloak, tucked it inside Harry&#39;s blankets, and then came back to\u003cbr\u003ethe other two. For a full minute the three of them stood and looked at\u003cbr\u003ethe little bundle; Hagrid&#39;s shoulders shook, Professor McGonagall\u003cbr\u003eblinked furiously, and the twinkling light that usually shone from\u003cbr\u003eDumbledore&#39;s eyes seemed to have gone out.\u003cbr\u003e&quot;Well,&quot; said Dumbledore finally, &quot;that&#39;s that. We&#39;ve no business staying\u003cbr\u003ehere. We may as well go and join the celebrations.&quot;\u003cbr\u003e&quot;Yeah,&quot; said Hagrid in a very muffled voice, &quot;I&#39;ll be takin&#39; Sirius his\u003cbr\u003ebike back. G&#39;night, Professor McGonagall -- Professor Dumbledore, sir.&quot;\u003cbr\u003eWiping his streaming eyes on his jacket sleeve, Hagrid swung himself\u003cbr\u003eonto the motorcycle and kicked the engine into life; with a roar it rose\u003cbr\u003einto the air and off into the night.\u003cbr\u003e&quot;I shall see you soon, I expect, Professor McGonagall,&quot; said Dumbledore,\u003cbr\u003enodding to her. Professor McGonagall blew her nose in reply.\u003cbr\u003eDumbledore turned and walked back down the street. On the corner he\u003cbr\u003estopped and took out the silver Put-Outer. He clicked it once, and\u003cbr\u003etwelve balls of light sped back to their street lamps so that Privet\u003cbr\u003eDrive glowed suddenly orange and he could make out a tabby cat slinking\u003cbr\u003earound the corner at the other end of the street. He could just see the\u003cbr\u003ebundle of blankets on the step of number four.\u003cbr\u003e&quot;Good luck, Harry,&quot; he murmured. He turned on his heel and with a swish\u003cbr\u003eof his cloak, he was gone.\u003cbr\u003eA breeze ruffled the neat hedges of Privet Drive, which lay silent and\u003cbr\u003etidy under the inky sky, the very last place you would expect\u003cbr\u003eastonishing things to happen. Harry Potter rolled over inside his\u003cbr\u003eblankets without waking up. One small hand closed on the letter beside\u003cbr\u003ehim and he slept on, not knowing he was special, not knowing he was\u003cbr\u003efamous, not knowing he would be woken in a few hours&#39; time by Mrs.\u003cbr\u003eDursley&#39;s scream as she opened the front door to put out the milk\u003cbr\u003ebottles, nor that he would spend the next few weeks being prodded and\u003cbr\u003epinched by his cousin Dudley... He couldn&#39;t know that at this very\u003cbr\u003emoment, people meeting in secret all over the country were holding up\u003cbr\u003etheir glasses and saying in hushed voices: &quot;To Harry Potter -- the boy\u003cbr\u003ewho lived!&quot;",
            "textOriginal": "Mr. and Mrs. Dursley, of number four, Privet Drive, were proud to say\nthat they were perfectly normal, thank you very much. They were the last\npeople you'd expect to be involved in anything strange or mysterious,\nbecause they just didn't hold with such nonsense.\nMr. Dursley was the director of a firm called Grunnings, which made\ndrills. He was a big, beefy man with hardly any neck, although he did\nhave a very large mustache. Mrs. Dursley was thin and blonde and had\nnearly twice the usual amount of neck, which came in very useful as she\nspent so much of her time craning over garden fences, spying on the\nneighbors. The Dursleys had a small son called Dudley and in their\nopinion there was no finer boy anywhere.\nThe Dursleys had everything they wantedbut they also had a secret, and\ntheir greatest fear was that somebody would discover it. They didn't\nthink they could bear it if anyone found out about the Potters. Mrs.\nPotter was Mrs. Dursley's sisterbut they hadn't met for several years;\nin fact, Mrs. Dursley pretended she didn't have a sister, because her\nsister and her good-for-nothing husband were as unDursleyish as it was\npossible to be. The Dursleys shuddered to think what the neighbors would\nsay if the Potters arrived in the street. The Dursleys knew that the\nPotters had a small son, toobut they had never even seen him. This boy\nwas another good reason for keeping the Potters away; they didn't want\nDudley mixing with a child like that.\nWhen Mr. and Mrs. Dursley woke up on the dull, gray Tuesday our story\nstarts, there was nothing about the cloudy sky outside to suggest that\nstrange and mysterious things would soon be happening all over the\ncountry. Mr. Dursley hummed as he picked out his most boring tie for\nwork, and Mrs. Dursley gossiped away happily as she wrestled a screaming\nDudley into his high chair.\nNone of them noticed a large, tawny owl flutter past the window.\nAt half past eight, Mr. Dursley picked up his briefcase, pecked Mrs.\nDursley on the cheek, and tried to kiss Dudley good-bye but missed,\nbecause Dudley was now having a tantrum and throwing his cereal at the\nwalls. \"Little tyke,\" chortled Mr. Dursley as he left the house. He got\ninto his car and backed out of number four's drive.\nIt was on the corner of the street that he noticed the first sign of\nsomething peculiar -- a cat reading a map. For a second, Mr. Dursley\ndidn't realize what he had seen -- then he jerked his head around to\nlook again. There was a tabby cat standing on the corner of Privet\nDrivebut there wasn't a map in sight. What could he have been thinking\nof? It must have been a trick of the light. Mr. Dursley blinked and\nstared at the cat. It stared back. As Mr. Dursley drove around the\ncorner and up the road, he watched the cat in his mirror. It was now\nreading the sign that said Privet Drive -- no, looking at the sign; cats\ncouldn't read maps or signs. Mr. Dursley gave himself a little shake and\nput the cat out of his mind. As he drove toward town he thought of\nnothing except a large order of drills he was hoping to get that day.\nBut on the edge of town, drills were driven out of his mind by something\nelse. As he sat in the usual morning traffic jam, he couldn't help\nnoticing that there seemed to be a lot of strangely dressed people\nabout. People in cloaks. Mr. Dursley couldn't bear people who dressed in\nfunny clothes -- the getups you saw on young people! He supposed this\nwas some stupid new fashion. He drummed his fingers on the steering\nwheel and his eyes fell on a huddle of these weirdos standing quite\nclose by. They were whispering excitedly together. Mr. Dursley was\nenraged to see that a couple of them weren't young at all; why, that man\nhad to be older than he was, and wearing an emerald-green cloak! The\nnerve of him! But then it struck Mr. Dursley that this was probably some\nsilly stunt -- these people were obviously collecting for something...\nyes, that would be it. The traffic moved on and a few minutes later, Mr.\nDursley arrived in the Grunnings parking lot, his mind back on drills.\nMr. Dursley always sat with his back to the window in his office on the\nninth floor. If he hadn't, he might have found it harder to concentrate\non drills that morning. He didn't see the owls swoop ing past in broad\ndaylight, though people down in the street did; they pointed and gazed\nopen- mouthed as owl after owl sped overhead. Most of them had never\nseen an owl even at nighttime. Mr. Dursley, however, had a perfectly\nnormal, owl-free morning. He yelled at five different people. He made\nseveral important telephone calls and shouted a bit more. He was in a\nvery good mood until lunchtime, when he thought he'd stretch his legs\nand walk across the road to buy himself a bun from the bakery.\nHe'd forgotten all about the people in cloaks until he passed a group of\nthem next to the baker's. He eyed them angrily as he passed. He didn't\nknow whybut they made him uneasy. This bunch were whispering\nexcitedly, too, and he couldn't see a single collecting tin. It was on\nhis way back past them, clutching a large doughnut in a bag, that he\ncaught a few words of what they were saying.\n\"The Potters, that's right, that's what I heard yes, their son, Harry\"\nMr. Dursley stopped dead. Fear flooded him. He looked back at the\nwhisperers as if he wanted to say something to thembut thought better\nof it.\nHe dashed back across the road, hurried up to his office, snapped at his\nsecretary not to disturb him, seized his telephone, and had almost\nfinished dialing his home number when he changed his mind. He put the\nreceiver back down and stroked his mustache, thinking... no, he was\nbeing stupid. Potter wasn't such an unusual name. He was sure there were\nlots of people called Potter who had a son called Harry. Come to think\nof it, he wasn't even sure his nephew was called Harry. He'd never even\nseen the boy. It might have been Harvey. Or Harold. There was no point\nin worrying Mrs. Dursley; she always got so upset at any mention of her\nsister. He didn't blame her -- if he'd had a sister like that... but all\nthe same, those people in cloaks...\nHe found it a lot harder to concentrate on drills that afternoon and\nwhen he left the building at five o'clock, he was still so worried that\nhe walked straight into someone just outside the door.\n\"Sorry,\" he grunted, as the tiny old man stumbled and almost fell. It\nwas a few seconds before Mr. Dursley realized that the man was wearing a\nviolet cloak. He didn't seem at all upset at being almost knocked to the\nground. On the contrary, his face split into a wide smile and he said in\na squeaky voice that made passersby stare, \"Don't be sorry, my dear sir,\nfor nothing could upset me today! Rejoice, for You-Know-Who has gone at\nlast! Even Muggles like yourself should be celebrating, this happy,\nhappy day!\"\nAnd the old man hugged Mr. Dursley around the middle and walked off.\nMr. Dursley stood rooted to the spot. He had been hugged by a complete\nstranger. He also thought he had been called a Muggle, whatever that\nwas. He was rattled. He hurried to his car and set off for home, hoping\nhe was imagining things, which he had never hoped before, because he\ndidn't approve of imagination.\nAs he pulled into the driveway of number four, the first thing he saw --\nand it didn't improve his mood -- was the tabby cat he'd spotted that\nmorning. It was now sitting on his garden wall. He was sure it was the\nsame one; it had the same markings around its eyes.\n\"Shoo!\" said Mr. Dursley loudly. The cat didn't move. It just gave him a\nstern look. Was this normal cat behavior? Mr. Dursley wondered. Trying\nto pull himself together, he let himself into the house. He was still\ndetermined not to mention anything to his wife.\nMrs. Dursley had had a nice, normal day. She told him over dinner all\nabout Mrs. Next Door's problems with her daughter and how Dudley had\nlearned a new word (\"Won't!\"). Mr. Dursley tried to act normally. When\nDudley had been put to bed, he went into the living room in time to\ncatch the last report on the evening news:\n\"And finally, bird-watchers everywhere have reported that the nation's\nowls have been behaving very unusually today. Although owls normally\nhunt at night and are hardly ever seen in daylight, there have been\nhundreds of sightings of these birds flying in every direction since\nsunrise. Experts are unable to explain why the owls have suddenly\nchanged their sleeping pattern.\" The newscaster allowed himself a grin.\n\"Most mysterious. And now, over to Jim McGuffin with the weather. Going\nto be any more showers of owls tonight, Jim?\"\n\"Well, Ted,\" said the weatherman, \"I don't know about thatbut it's not\nonly the owls that have been acting oddly today. Viewers as far apart as\nKent, Yorkshire, and Dundee have been phoning in to tell me that instead\nof the rain I promised yesterday, they've had a downpour of shooting\nstars! Perhaps people have been celebrating Bonfire Night early -- it's\nnot until next week, folks! But I can promise a wet night tonight.\"\nMr. Dursley sat frozen in his armchair. Shooting stars all over Britain?\nOwls flying by daylight? Mysterious people in cloaks all over the place?\nAnd a whisper, a whisper about the Potters...\nMrs. Dursley came into the living room carrying two cups of tea. It was\nno good. He'd have to say something to her. He cleared his throat\nnervously. \"Er -- Petunia, dear -- you haven't heard from your sister\nlately, have you?\"\nAs he had expected, Mrs. Dursley looked shocked and angry. After all,\nthey normally pretended she didn't have a sister.\n\"No,\" she said sharply. \"Why?\"\n\"Funny stuff on the news,\" Mr. Dursley mumbled. \"Owls... shooting\nstars... and there were a lot of funny-looking people in town today...\"\n\"So?\" snapped Mrs. Dursley.\n\"Well, I just thought... maybe... it was something to do with... you\nknow... her crowd.\"\nMrs. Dursley sipped her tea through pursed lips. Mr. Dursley wondered\nwhether he dared tell her he'd heard the name \"Potter.\" He decided he\ndidn't dare. Instead he said, as casually as he could, \"Their son --\nhe'd be about Dudley's age now, wouldn't he?\"\n\"I suppose so,\" said Mrs. Dursley stiffly.\n\"What's his name again? Howard, isn't it?\"\n\"Harry. Nasty, common name, if you ask me.\"\n\"Oh, yes,\" said Mr. Dursley, his heart sinking horribly. \"Yes, I quite\nagree.\"\nHe didn't say another word on the subject as they went upstairs to bed.\nWhile Mrs. Dursley was in the bathroom, Mr. Dursley crept to the bedroom\nwindow and peered down into the front garden. The cat was still there.\nIt was staring down Privet Drive as though it were waiting for\nsomething.\nWas he imagining things? Could all this have anything to do with the\nPotters? If it did... if it got out that they were related to a pair of\n-- well, he didn't think he could bear it.\nThe Dursleys got into bed. Mrs. Dursley fell asleep quickly but Mr.\nDursley lay awake, turning it all over in his mind. His last, comforting\nthought before he fell asleep was that even if the Potters were\ninvolved, there was no reason for them to come near him and Mrs.\nDursley. The Potters knew very well what he and Petunia thought about\nthem and their kind.... He couldn't see how he and Petunia could get\nmixed up in anything that might be going on -- he yawned and turned over\n-- it couldn't affect them....\nHow very wrong he was.\nMr. Dursley might have been drifting into an uneasy sleepbut the cat\non the wall outside was showing no sign of sleepiness. It was sitting as\nstill as a statue, its eyes fixed unblinkingly on the far corner of\nPrivet Drive. It didn't so much as quiver when a car door slammed on the\nnext street, nor when two owls swooped overhead. In fact, it was nearly\nmidnight before the cat moved at all.\nA man appeared on the corner the cat had been watching, appeared so\nsuddenly and silently you'd have thought he'd just popped out of the\nground. The cat's tail twitched and its eyes narrowed.\nNothing like this man had ever been seen on Privet Drive. He was tall,\nthin, and very old, judging by the silver of his hair and beard, which\nwere both long enough to tuck into his belt. He was wearing long robes,\na purple cloak that swept the ground, and high-heeled, buckled boots.\nHis blue eyes were light, bright, and sparkling behind half-moon\nspectacles and his nose was very long and crooked, as though it had been\nbroken at least twice. This man's name was Albus Dumbledore.\nAlbus Dumbledore didn't seem to realize that he had just arrived in a\nstreet where everything from his name to his boots was unwelcome. He was\nbusy rummaging in his cloak, looking for something. But he did seem to\nrealize he was being watched, because he looked up suddenly at the cat,\nwhich was still staring at him from the other end of the street. For\nsome reason, the sight of the cat seemed to amuse him. He chuckled and\nmuttered, \"I should have known.\"\nHe found what he was looking for in his inside pocket. It seemed to be a\nsilver cigarette lighter. He flicked it open, held it up in the air, and\nclicked it. The nearest street lamp went out with a little pop. He\nclicked it again -- the next lamp flickered into darkness. Twelve times\nhe clicked the Put-Outer, until the only lights left on the whole street\nwere two tiny pinpricks in the distance, which were the eyes of the cat\nwatching him. If anyone looked out of their window now, even beady-eyed\nMrs. Dursley, they wouldn't be able to see anything that was happening\ndown on the pavement. Dumbledore slipped the Put-Outer back inside his\ncloak and set off down the street toward number four, where he sat down\non the wall next to the cat. He didn't look at itbut after a moment he\nspoke to it.\n\"Fancy seeing you here, Professor McGonagall.\"\nHe turned to smile at the tabbybut it had gone. Instead he was smiling\nat a rather severe-looking woman who was wearing square glasses exactly\nthe shape of the markings the cat had had around its eyes. She, too, was\nwearing a cloak, an emerald one. Her black hair was drawn into a tight\nbun. She looked distinctly ruffled.\n\"How did you know it was me?\" she asked.\n\"My dear Professor, I 've never seen a cat sit so stiffly.\"\n\"You'd be stiff if you'd been sitting on a brick wall all day,\" said\nProfessor McGonagall.\n\"All day? When you could have been celebrating? I must have passed a\ndozen feasts and parties on my way here.\"\nProfessor McGonagall sniffed angrily.\n\"Oh yes, everyone's celebrating, all right,\" she said impatiently.\n\"You'd think they'd be a bit more carefulbut no -- even the Muggles\nhave noticed something's going on. It was on their news.\" She jerked her\nhead back at the Dursleys' dark living-room window. \"I heard it. Flocks\nof owls... shooting stars.... Well, they're not completely stupid. They\nwere bound to notice something. Shooting stars down in Kent -- I'll bet\nthat was Dedalus Diggle. He never had much sense.\"\n\"You can't blame them,\" said Dumbledore gently. \"We've had precious\nlittle to celebrate for eleven years.\"\n\"I know that,\" said Professor McGonagall irritably. \"But that's no\nreason to lose our heads. People are being downright careless, out on\nthe streets in broad daylight, not even dressed in Muggle clothes,\nswapping rumors.\"\nShe threw a sharp, sideways glance at Dumbledore here, as though hoping\nhe was going to tell her somethingbut he didn't, so she went on. \"A\nfine thing it would be if, on the very day YouKnow-Who seems to have\ndisappeared at last, the Muggles found out about us all. I suppose he\nreally has gone, Dumbledore?\"\n\"It certainly seems so,\" said Dumbledore. \"We have much to be thankful\nfor. Would you care for a lemon drop?\"\n\"A what?\"\n\"A lemon drop. They're a kind of Muggle sweet I'm rather fond of\"\n\"No, thank you,\" said Professor McGonagall coldly, as though she didn't\nthink this was the moment for lemon drops. \"As I say, even if\nYou-Know-Who has gone -\"\n\"My dear Professor, surely a sensible person like yourself can call him\nby his name? All this 'You- Know-Who' nonsense -- for eleven years I\nhave been trying to persuade people to call him by his proper name:\nVoldemort.\" Professor McGonagall flinchedbut Dumbledore, who was\nunsticking two lemon drops, seemed not to notice. \"It all gets so\nconfusing if we keep saying 'You-Know-Who.' I have never seen any reason\nto be frightened of saying Voldemort's name.\n\"I know you haven 't, said Professor McGonagall, sounding half\nexasperated, half admiring. \"But you're different. Everyone knows you're\nthe only one You-Know- oh, all right, Voldemort, was frightened of.\"\n\"You flatter me,\" said Dumbledore calmly. \"Voldemort had powers I will\nnever have.\"\n\"Only because you're too -- well -- noble to use them.\"\n\"It's lucky it's dark. I haven't blushed so much since Madam Pomfrey\ntold me she liked my new earmuffs.\"\nProfessor McGonagall shot a sharp look at Dumbledore and said, \"The owls\nare nothing next to the rumors that are flying around. You know what\neveryone's saying? About why he's disappeared? About what finally\nstopped him?\"\nIt seemed that Professor McGonagall had reached the point she was most\nanxious to discuss, the real reason she had been waiting on a cold, hard\nwall all day, for neither as a cat nor as a woman had she fixed\nDumbledore with such a piercing stare as she did now. It was plain that\nwhatever \"everyone\" was saying, she was not going to believe it until\nDumbledore told her it was true. Dumbledore, however, was choosing\nanother lemon drop and did not answer.\n\"What they're saying,\" she pressed on, \"is that last night Voldemort\nturned up in Godric's Hollow. He went to find the Potters. The rumor is\nthat Lily and James Potter are -- are -- that they're -- dead. \"\nDumbledore bowed his head. Professor McGonagall gasped.\n\"Lily and James... I can't believe it... I didn't want to believe it...\nOh, Albus...\"\nDumbledore reached out and patted her on the shoulder. \"I know... I\nknow...\" he said heavily.\nProfessor McGonagall's voice trembled as she went on. \"That's not all.\nThey're saying he tried to kill the Potter's son, Harry. But -- he\ncouldn't. He couldn't kill that little boy. No one knows why, or how,\nbut they're saying that when he couldn't kill Harry Potter, Voldemort's\npower somehow broke -- and that's why he's gone.\nDumbledore nodded glumly.\n\"It's -- it's true?\" faltered Professor McGonagall. \"After all he's\ndone... all the people he's killed... he couldn't kill a little boy?\nIt's just astounding... of all the things to stop him... but how in the\nname of heaven did Harry survive?\"\n\"We can only guess,\" said Dumbledore. \"We may never know.\"\nProfessor McGonagall pulled out a lace handkerchief and dabbed at her\neyes beneath her spectacles. Dumbledore gave a great sniff as he took a\ngolden watch from his pocket and examined it. It was a very odd watch.\nIt had twelve hands but no numbers; instead, little planets were moving\naround the edge. It must have made sense to Dumbledore, though, because\nhe put it back in his pocket and said, \"Hagrid's late. I suppose it was\nhe who told you I'd be here, by the way?\"\n\"Yes,\" said Professor McGonagall. \"And I don't suppose you're going to\ntell me why you're here, of all places?\"\n\"I've come to bring Harry to his aunt and uncle. They're the only family\nhe has left now.\"\n\"You don't mean -- you can't mean the people who live here?\" cried\nProfessor McGonagall, jumping to her feet and pointing at number four.\n\"Dumbledore -- you can't. I've been watching them all day. You couldn't\nfind two people who are less like us. And they've got this son -- I saw\nhim kicking his mother all the way up the street, screaming for sweets.\nHarry Potter come and live here!\"\n\"It's the best place for him,\" said Dumbledore firmly. \"His aunt and\nuncle will be able to explain everything to him when he's older. I've\nwritten them a letter.\"\n\"A letter?\" repeated Professor McGonagall faintly, sitting back down on\nthe wall. \"Really, Dumbledore, you think you can explain all this in a\nletter? These people will never understand him! He'll be famous -- a\nlegend -- I wouldn't be surprised if today was known as Harry Potter day\nin the future -- there will be books written about Harry -- every child\nin our world will know his name!\"\n\"Exactly,\" said Dumbledore, looking very seriously over the top of his\nhalf-moon glasses. \"It would be enough to turn any boy's head. Famous\nbefore he can walk and talk! Famous for something he won't even\nremember! CarA you see how much better off he'll be, growing up away\nfrom all that until he's ready to take it?\"\nProfessor McGonagall opened her mouth, changed her mind, swallowed, and\nthen said, \"Yes -- yes, you're right, of course. But how is the boy\ngetting here, Dumbledore?\" She eyed his cloak suddenly as though she\nthought he might be hiding Harry underneath it.\n\"Hagrid's bringing him.\"\n\"You think it -- wise -- to trust Hagrid with something as important as\nthis?\"\nI would trust Hagrid with my life,\" said Dumbledore.\n\"I'm not saying his heart isn't in the right place,\" said Professor\nMcGonagall grudgingly, \"but you can't pretend he's not careless. He does\ntend to -- what was that?\"\nA low rumbling sound had broken the silence around them. It grew\nsteadily louder as they looked up and down the street for some sign of a\nheadlight; it swelled to a roar as they both looked up at the sky -- and\na huge motorcycle fell out of the air and landed on the road in front of\nthem.\nIf the motorcycle was huge, it was nothing to the man sitting astride\nit. He was almost twice as tall as a normal man and at least five times\nas wide. He looked simply too big to be allowed, and so wild - long\ntangles of bushy black hair and beard hid most of his face, he had hands\nthe size of trash can lids, and his feet in their leather boots were\nlike baby dolphins. In his vast, muscular arms he was holding a bundle\nof blankets.\n\"Hagrid,\" said Dumbledore, sounding relieved. \"At last. And where did\nyou get that motorcycle?\"\n\"Borrowed it, Professor Dumbledore, sit,\" said the giant, climbing\ncarefully off the motorcycle as he spoke. \"Young Sirius Black lent it to\nme. I've got him, sir.\"\n\"No problems, were there?\"\n\"No, sir -- house was almost destroyedbut I got him out all right\nbefore the Muggles started swarmin' around. He fell asleep as we was\nflyin' over Bristol.\"\nDumbledore and Professor McGonagall bent forward over the bundle of\nblankets. Inside, just visible, was a baby boy, fast asleep. Under a\ntuft of jet-black hair over his forehead they could see a curiously\nshaped cut, like a bolt of lightning.\n\"Is that where -?\" whispered Professor McGonagall.\n\"Yes,\" said Dumbledore. \"He'll have that scar forever.\"\n\"Couldn't you do something about it, Dumbledore?\"\n\"Even if I could, I wouldn't. Scars can come in handy. I have one myself\nabove my left knee that is a perfect map of the London Underground. Well\n-- give him here, Hagrid -- we'd better get this over with.\"\nDumbledore took Harry in his arms and turned toward the Dursleys' house.\n\"Could I -- could I say good-bye to him, sir?\" asked Hagrid. He bent his\ngreat, shaggy head over Harry and gave him what must have been a very\nscratchy, whiskery kiss. Then, suddenly, Hagrid let out a howl like a\nwounded dog.\n\"Shhh!\" hissed Professor McGonagall, \"you'll wake the Muggles!\"\n\"S-s-sorry,\" sobbed Hagrid, taking out a large, spotted handkerchief and\nburying his face in it. \"But I c-c-can't stand it -- Lily an' James dead\n-- an' poor little Harry off ter live with Muggles -\"\n\"Yes, yes, it's all very sadbut get a grip on yourself, Hagrid, or\nwe'll be found,\" Professor McGonagall whispered, patting Hagrid gingerly\non the arm as Dumbledore stepped over the low garden wall and walked to\nthe front door. He laid Harry gently on the doorstep, took a letter out\nof his cloak, tucked it inside Harry's blankets, and then came back to\nthe other two. For a full minute the three of them stood and looked at\nthe little bundle; Hagrid's shoulders shook, Professor McGonagall\nblinked furiously, and the twinkling light that usually shone from\nDumbledore's eyes seemed to have gone out.\n\"Well,\" said Dumbledore finally, \"that's that. We've no business staying\nhere. We may as well go and join the celebrations.\"\n\"Yeah,\" said Hagrid in a very muffled voice, \"I'll be takin' Sirius his\nbike back. G'night, Professor McGonagall -- Professor Dumbledore, sir.\"\nWiping his streaming eyes on his jacket sleeve, Hagrid swung himself\nonto the motorcycle and kicked the engine into life; with a roar it rose\ninto the air and off into the night.\n\"I shall see you soon, I expect, Professor McGonagall,\" said Dumbledore,\nnodding to her. Professor McGonagall blew her nose in reply.\nDumbledore turned and walked back down the street. On the corner he\nstopped and took out the silver Put-Outer. He clicked it once, and\ntwelve balls of light sped back to their street lamps so that Privet\nDrive glowed suddenly orange and he could make out a tabby cat slinking\naround the corner at the other end of the street. He could just see the\nbundle of blankets on the step of number four.\n\"Good luck, Harry,\" he murmured. He turned on his heel and with a swish\nof his cloak, he was gone.\nA breeze ruffled the neat hedges of Privet Drive, which lay silent and\ntidy under the inky sky, the very last place you would expect\nastonishing things to happen. Harry Potter rolled over inside his\nblankets without waking up. One small hand closed on the letter beside\nhim and he slept on, not knowing he was special, not knowing he was\nfamous, not knowing he would be woken in a few hours' time by Mrs.\nDursley's scream as she opened the front door to put out the milk\nbottles, nor that he would spend the next few weeks being prodded and\npinched by his cousin Dudley... He couldn't know that at this very\nmoment, people meeting in secret all over the country were holding up\ntheir glasses and saying in hushed voices: \"To Harry Potter -- the boy\nwho lived!\"",
