            "textDisplay": "This is to show difference between classical relativity having galilean transformation and theory of relativity or relativity having lorentz transformation. The wave equation is given by,\u003cbr\u003e  c² d²/dr² = d²/dt²,    where c is speed of wave.\u003cbr\u003eIts possible solution is sinusoidal function, omitting amplitude and type of function here stating its phase function □ which determine value of wave function at given time and distance coordintaes is,   □ = kr - wt\u003cbr\u003e\u003cbr\u003eFrame S is at rest and S&#39; moving with speed v relative to S. Then solution of wave equation having phase as,   □ = kr&#39; - wt&#39;,  for S&#39;.\u003cbr\u003eAs phase is constant for wave moving in frame, then for r&#39;1, t&#39;1 and r&#39;2, t&#39;2 phase difference is,\u003cbr\u003e  □2-□1 = k(r&#39;2-r&#39;1) - w(t&#39;2-t&#39;1) = k◇r&#39; - w◇t&#39;=0 =&gt; ◇r&#39;/◇t&#39; = w/k = c&#39;\u003cbr\u003eFor wave in S&#39; observed by S according to classical relativity,\u003cbr\u003e k◇r - w◇t = k(◇r&#39; + v◇t&#39;) - k(c&#39; + v)◇t&#39; = 0, \u003cbr\u003ewhere w = kc&#39; and r = r&#39; + vt&#39;, t = t&#39;\u003cbr\u003eSo, ◇r/◇t = ◇r&#39;/◇t&#39; = w/k = c&#39; = c\u003cbr\u003eThus speed of wave in S&#39; observed by S&#39; and S is same according to galilean transformation.\u003cbr\u003e\u003cbr\u003eNow if phase of wave from moving source S&#39; emitted wave and observed in S is given by,\u003cbr\u003e  □ = kr - kct = kr - k(c&#39; + v)t,\u003cbr\u003ewhere c = c&#39; + v, according to galilean transformation and c&#39; is speed of wave in S&#39; or with respect to source and c is speed of wave in S or to observer at rest.\u003cbr\u003eThus,   w = w&#39; + kv,   where w&#39; is frequency of wave emitted from source and w is frequency of wave observed by observer, this is doppler effect. So classical relativity inherently have doppler effect.\u003cbr\u003e\u003cbr\u003eNow according to theory of relativity having lorentz transformation, phase difference of wave in S&#39; observed by S&#39; is given by,\u003cbr\u003e  □2 - □1 = k◇r&#39; - w◇t&#39; = 0  ==&gt;  ◇r&#39;/◇t&#39; = w/k = c&#39;\u003cbr\u003ePhase difference of wave in S&#39; observed by S is given by,\u003cbr\u003e  k◇r - w◇t = k(◇r&#39; + v◇t&#39;) - kc&#39;(◇t&#39; + v◇r&#39;/c²)\u003cbr\u003eThis shows that speed of wave is not same for both observers and in case of light it is,  c = c&#39; - v.\u003cbr\u003e\u003cbr\u003eFor phase difference of wave emitting from moving source S&#39; and observed in S at rest is,\u003cbr\u003e k◇r - kc&#39;◇t ==&gt; c = c&#39;\u003cbr\u003e\u003cbr\u003eThus wavefront of wave in relative measurement is spherical in classical relativity and elliptical as per theory of relativity. But wavefront of wave for moving source is spherical in theory of relativity and elliptical in classical relativity. Important thing is that due to spherical wavefront inspite of moving source, relative speed doesnt remain constant and heavenly bodies seems receeding. While wave front is elliptical in classical relativity so, speed of source is accounted. Also this is the reason why circular orbit seems elliptical.",
            "textOriginal": "This is to show difference between classical relativity having galilean transformation and theory of relativity or relativity having lorentz transformation. The wave equation is given by,\n  c² d²/dr² = d²/dt²,    where c is speed of wave.\nIts possible solution is sinusoidal function, omitting amplitude and type of function here stating its phase function □ which determine value of wave function at given time and distance coordintaes is,   □ = kr - wt\n\nFrame S is at rest and S' moving with speed v relative to S. Then solution of wave equation having phase as,   □ = kr' - wt',  for S'.\nAs phase is constant for wave moving in frame, then for r'1, t'1 and r'2, t'2 phase difference is,\n  □2-□1 = k(r'2-r'1) - w(t'2-t'1) = k◇r' - w◇t'=0 =\u003e ◇r'/◇t' = w/k = c'\nFor wave in S' observed by S according to classical relativity,\n k◇r - w◇t = k(◇r' + v◇t') - k(c' + v)◇t' = 0, \nwhere w = kc' and r = r' + vt', t = t'\nSo, ◇r/◇t = ◇r'/◇t' = w/k = c' = c\nThus speed of wave in S' observed by S' and S is same according to galilean transformation.\n\nNow if phase of wave from moving source S' emitted wave and observed in S is given by,\n  □ = kr - kct = kr - k(c' + v)t,\nwhere c = c' + v, according to galilean transformation and c' is speed of wave in S' or with respect to source and c is speed of wave in S or to observer at rest.\nThus,   w = w' + kv,   where w' is frequency of wave emitted from source and w is frequency of wave observed by observer, this is doppler effect. So classical relativity inherently have doppler effect.\n\nNow according to theory of relativity having lorentz transformation, phase difference of wave in S' observed by S' is given by,\n  □2 - □1 = k◇r' - w◇t' = 0  ==\u003e  ◇r'/◇t' = w/k = c'\nPhase difference of wave in S' observed by S is given by,\n  k◇r - w◇t = k(◇r' + v◇t') - kc'(◇t' + v◇r'/c²)\nThis shows that speed of wave is not same for both observers and in case of light it is,  c = c' - v.\n\nFor phase difference of wave emitting from moving source S' and observed in S at rest is,\n k◇r - kc'◇t ==\u003e c = c'\n\nThus wavefront of wave in relative measurement is spherical in classical relativity and elliptical as per theory of relativity. But wavefront of wave for moving source is spherical in theory of relativity and elliptical in classical relativity. Important thing is that due to spherical wavefront inspite of moving source, relative speed doesnt remain constant and heavenly bodies seems receeding. While wave front is elliptical in classical relativity so, speed of source is accounted. Also this is the reason why circular orbit seems elliptical.",
