            "textDisplay": "Seriously this whole time dilation thing is just an illusion. I&#39;m sure that if we could actually send someone through space at the speed of light and come back both him and us on Earth would have aged at exactly the same rate.  Then scientists would look like fools and have to revise their precious theory.   Too bad we can&#39;t test this on living beings to see if the actual aging process of cells is affected by moving at higher speeds.\u003cbr\u003e\u003cbr\u003eSatellite&#39;s running at slightly different speeds is no proof of actual time itself slowing down for three simple reasons:\u003cbr\u003e-The radius of a satellite&#39;s orbit is greater than the radius of Earth which has to be taken into account to calculate the exact time for a specific position on Earth.\u003cbr\u003e-It takes time for signals to be sent back and forth (lag).\u003cbr\u003e-Mechanical devices (such as clocks) and the electrons which power them function differently without the interaction of gravitational forces.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eThe only way to really prove time dilation is to study the aging rate of cells from a living organism moving at near lightspeed.  Which is basically impossible.\u003cbr\u003eAnd until we find a way to do this, time dilation remains a fantastic science fiction theory.",
            "textOriginal": "Seriously this whole time dilation thing is just an illusion. I'm sure that if we could actually send someone through space at the speed of light and come back both him and us on Earth would have aged at exactly the same rate.  Then scientists would look like fools and have to revise their precious theory.   Too bad we can't test this on living beings to see if the actual aging process of cells is affected by moving at higher speeds.\n\nSatellite's running at slightly different speeds is no proof of actual time itself slowing down for three simple reasons:\n-The radius of a satellite's orbit is greater than the radius of Earth which has to be taken into account to calculate the exact time for a specific position on Earth.\n-It takes time for signals to be sent back and forth (lag).\n-Mechanical devices (such as clocks) and the electrons which power them function differently without the interaction of gravitational forces.\n\n\nThe only way to really prove time dilation is to study the aging rate of cells from a living organism moving at near lightspeed.  Which is basically impossible.\nAnd until we find a way to do this, time dilation remains a fantastic science fiction theory.",
