      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "L-LTOLEyvTdT30AxB6_5a-D8Gm4",
          "id": "UgyhQvc3m2oPoXH2Vml4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Time is fascinating. I worked the subway stations for nearly 10 years. From one end of the city to the other. Every so often I would notice the city would be saying that, &quot;Today just flew by&quot; or &quot;The day was just dragging along.&quot;  How can an entire city complain about the same time paradox unless it was effected by it. Maybe a time distorted bubble the earth passes through in its revolution around the sun. Maybe random waves of time distortion hitting the earth? Maybe they&#39;re randomly given off by the sun. Maybe they&#39;re from outside our Terran system and reach us in intervals. ???? Ti-i-i-ime, is on my side. Yes, it is!",
            "textOriginal": "Time is fascinating. I worked the subway stations for nearly 10 years. From one end of the city to the other. Every so often I would notice the city would be saying that, \"Today just flew by\" or \"The day was just dragging along.\"  How can an entire city complain about the same time paradox unless it was effected by it. Maybe a time distorted bubble the earth passes through in its revolution around the sun. Maybe random waves of time distortion hitting the earth? Maybe they're randomly given off by the sun. Maybe they're from outside our Terran system and reach us in intervals. ???? Ti-i-i-ime, is on my side. Yes, it is!",
            "authorDisplayName": "MichaelC Copeland Sr",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu8M64FpZt1qjUDEAj0LogJlptWpDt8v4tL5yQ=s48-c-k-c0x00ffffff-no-rj",
