      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "ud5CHrB_0pJhOOCOfRGy9kJAqKE",
          "id": "UgyBwUqwDQiwgy_U3814AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "My idea so I get to name it! Voyager 1 is now in interstellar time or &quot;Mikey&#39;s Time.&quot; Think of it like Alvin and the chipmunks. &quot;Vyger&#39;s&quot; message is sped up now that it&#39;s outside our suns time bubble or &quot;Terran Time.&quot;  It would be faster still if &quot;Vyger&quot; sent a message from beyond the Milky Way&#39;s time bubble. (That name is still up for grabs.) Then there&#39;s Outside the Local Group time bubble, so on and so on until we get to the, &quot;True Interstellar Time Standard.&quot;  Now that &quot;Vyger&quot; is in interstellar space, it&#39;s also in the Milky Way&#39;s STANDARD, faster moving, interstellar time or &quot;Mikey&#39;s Time.&quot;\u003cbr\u003e•Our sun&#39;s time bubble: &quot;Terran Time&quot; we know and have measured.\u003cbr\u003e•Milky Way&#39;s time bubble or &quot;Mikey&#39;s Time.&quot; The rate/flow of TIME outside any influence but within the Milky Way: We just got there and are still figuring. Wild guess I&#39;d say time will increase in speed, now and until Vyger is outside the Ort cloud .007-.07% faster, maybe. Just for reference. \u003cbr\u003e•Local Group&#39;s time bubble or the rate/flow of time outside of any influence but within the Local Group: Name still open and unknown. Wild guess .08% to a couple seconds faster, maybe. Used just for reference.\u003cbr\u003e•Outside any influence in the, &quot;True Interstellar Time Standard,&quot; or...;-P Name NOT up for grabs BUT just begging to be measured. The rate/flow of time is fastest here so, surfing time here is choice. Though it&#39;s best to have your motor boat. ;-P\u003cbr\u003eA minute is a minute in all. It&#39;s the rate/flow I&#39;m talking about.\u003cbr\u003eThe Milky Way&#39;s Interstellar Time Standard will be known as, &quot;Mikey&#39;s Time.&quot;\u003cbr\u003ePass it on, please and thank you.",
            "textOriginal": "My idea so I get to name it! Voyager 1 is now in interstellar time or \"Mikey's Time.\" Think of it like Alvin and the chipmunks. \"Vyger's\" message is sped up now that it's outside our suns time bubble or \"Terran Time.\"  It would be faster still if \"Vyger\" sent a message from beyond the Milky Way's time bubble. (That name is still up for grabs.) Then there's Outside the Local Group time bubble, so on and so on until we get to the, \"True Interstellar Time Standard.\"  Now that \"Vyger\" is in interstellar space, it's also in the Milky Way's STANDARD, faster moving, interstellar time or \"Mikey's Time.\"\n•Our sun's time bubble: \"Terran Time\" we know and have measured.\n•Milky Way's time bubble or \"Mikey's Time.\" The rate/flow of TIME outside any influence but within the Milky Way: We just got there and are still figuring. Wild guess I'd say time will increase in speed, now and until Vyger is outside the Ort cloud .007-.07% faster, maybe. Just for reference. \n•Local Group's time bubble or the rate/flow of time outside of any influence but within the Local Group: Name still open and unknown. Wild guess .08% to a couple seconds faster, maybe. Used just for reference.\n•Outside any influence in the, \"True Interstellar Time Standard,\" or...;-P Name NOT up for grabs BUT just begging to be measured. The rate/flow of time is fastest here so, surfing time here is choice. Though it's best to have your motor boat. ;-P\nA minute is a minute in all. It's the rate/flow I'm talking about.\nThe Milky Way's Interstellar Time Standard will be known as, \"Mikey's Time.\"\nPass it on, please and thank you.",
