    {
      "kind": "youtube#commentThread",
      "etag": "ykrfJvXj2kn4uDzaYmydgtADfIc",
      "id": "UgwChXuN7Mrrp_-C9fV4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "tzuxwyjfJquug5zIL-ozhpUlmKM",
          "id": "UgwChXuN7Mrrp_-C9fV4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "I believe quantum particles are particles that exist in past, present and future at the same time. That&#39;s why quantum particles that do not connect in any way, react the same way. It&#39;s the same particle.  How do these particles come to exist in all of time, at the same time, you ask. Maybe the same way all of matter gets focused to one point. This is how all the TIME this particle wasn&#39;t there,  exists in the same TIME it is there.  See, quantum reality.\u003cbr\u003eI believe the TIME Force/quantum reality/quantum realm is fluid.  When it takes 500k of our years for one millionth of a second to pass inside a black hole. (Heavy Time)  Then you have a white hole&#39;s ENTIRE existence flashing by in an instant.  (Light Time)  You can imagine time being a fluid force. I mean, if it walks like a duck and quacks like a force, it might not be just a causality.",
            "textOriginal": "I believe quantum particles are particles that exist in past, present and future at the same time. That's why quantum particles that do not connect in any way, react the same way. It's the same particle.  How do these particles come to exist in all of time, at the same time, you ask. Maybe the same way all of matter gets focused to one point. This is how all the TIME this particle wasn't there,  exists in the same TIME it is there.  See, quantum reality.\nI believe the TIME Force/quantum reality/quantum realm is fluid.  When it takes 500k of our years for one millionth of a second to pass inside a black hole. (Heavy Time)  Then you have a white hole's ENTIRE existence flashing by in an instant.  (Light Time)  You can imagine time being a fluid force. I mean, if it walks like a duck and quacks like a force, it might not be just a causality.",
            "authorDisplayName": "MichaelC Copeland Sr",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu8M64FpZt1qjUDEAj0LogJlptWpDt8v4tL5yQ=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UCQE3zzg16zALp1A3Ru54fEQ",
            "authorChannelId": {
              "value": "UCQE3zzg16zALp1A3Ru54fEQ"
            },
